          Beatles (in italiano I Beatles, pronunciato /\u02c8bitols/, in inglese /\u02c8bi\u02d0t(\u0259)lz/),
          soprannominati The Fab Four (I favolosi quattro), sono stati un gruppo rock
          britannico, originario di Liverpool e attivo dal 1960 al 1970. La formazione,
          composta da John Lennon, Paul McCartney, George Harrison e Ringo Starr, ha
          segnato un''epoca nella musica, nel costume, nella moda e nella pop art. Ritenuti
          un fenomeno di comunicazione di massa di proporzioni mondiali[11] e considerati
          tra le maggiori espressioni della musica contemporanea, a distanza di vari
          decenni dal loro scioglimento ufficiale \u2013 e dopo la morte di due dei
          quattro componenti \u2013 i Beatles contano ancora un enorme seguito e numerosi
          sono i loro fan club esistenti in ogni parte del mondo.\n\nSecondo una stima
          del 2001, \u00e8 risultato in assoluto il gruppo musicale di maggior successo
          commerciale, con vendite complessive che superano il miliardo di dischi e
          di musicassette, e per la rivista Rolling Stone i Beatles sono i pi\u00f9
          grandi artisti di tutti i tempi.\n\nL''aura \u2013 per molti versi non sempre
          codificabile secondo i canoni comuni \u2013 che circonda lo sviluppo del loro
          successo mediatico e che ha favorito la nascita della cosiddetta Beatlemania
