          The Beatles fueron en su mayor\u00eda escritas y grabadas durante un periodo
          de turbulencias en el grupo. Despu\u00e9s de visitar al Maharishi Mahesh Yogi
          en la India y durante un periodo productivo de composiciones a principios
          de 1968, el grupo regres\u00f3 al estudio para grabar durante el mes de mayo
          hasta octubre de 1968.\n\nTras su lanzamiento en noviembre de 1968, el \u00e1lbum
          ha recibido distintas cr\u00edticas mixtas y alcanz\u00f3 el n\u00ba 1 en
          el Reino Unido y Estados Unidos. En 2003, la revista musical Rolling Stone
          lo coloc\u00f3 en el puesto n\u00famero 10 de su lista de los 500 mejores
          \u00e1lbumes de todos los tiempos. Es uno de los seis \u00e1lbumes certificados
          con disco de diamante de The Beatles, lo que los convierte en los m\u00e1ximos
          ganadores de este reconocimiento en la historia de la m\u00fasica. Los otros
          \u00e1lbumes con disco de diamante son The Beatles/1962-1966, The Beatles/1967-1970,
          Abbey Road, Sgt. Pepper''s Lonely Hearts Club Band y 1.","strDescriptionPT":"The
          Beatles \u00e9 o d\u00e9cimo \u00e1lbum dos Beatles, lan\u00e7ado como disco
          duplo em 22 de novembro de 1968. Este \u00e1lbum est\u00e1 na lista dos 200
          \u00e1lbuns definitivos no Rock and Roll Hall of Fame.\n\n\u00c9 popularmente
          conhecido como The White Album (O \u00c1lbum Branco), por n\u00e3o haver nome,
          e ser apenas um fundo branco com o nome da banda em relevo. A capa foi criada
          pelo artista pop Richard Hamilton e o t\u00edtulo original era para ser A
          Doll\u2019s House, mas uma banda brit\u00e2nica chamada Family, j\u00e1 tinha
          lan\u00e7ado um \u00e1lbum com nome similar. Foi o primeiro disco lan\u00e7ado
          ap\u00f3s a morte do manager Brian Epstein.\n\nEm 1997, O \u00c1lbum Branco
          foi nomeado o d\u00e9cimo melhor disco de todos os tempos pela \"Music of
          the Millennium\" da Classic FM. Em 1998 a Q Magazine colocou como 17\u00b0
          lugar e em 2000 em 7\u00b0 lugar. A Rolling Stone colocou como o d\u00e9cimo
          entre 500 \u00e1lbuns e o canal VH1 como 11\u00b0 lugar. De acordo com a Associa\u00e7\u00e3o
          da Ind\u00fastria de Discos da Am\u00e9rica, o disco \u00e9 19 vezes disco
          de platina e o d\u00e9cimo disco mais vendido nos Estados Unidos.\n\nEm 2010,
          um colecionador argentino possu\u00eda o \u00e1lbum com assinaturas originais
          dos quatro beatles. A pe\u00e7a foi vendida na ocasi\u00e3o por 33 mil d\u00f3lares.","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"9.3","intScoreVotes":"3","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"055be730-dcad-31bf-b550-45ba9c202aa3","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"mw0000418113","strBBCReviewID":"4b8c","strRateYourMusicID":"the_beatles__white_album__f13","strDiscogsID":"46402","strWikidataID":"Q3295515","strWikipediaID":"The_Beatles_(album)","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":"Beatles_[The_White_Album],_The","strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2109681","idArtist":"111247","idLabel":"43827","strAlbum":"Help!","strAlbumStripped":"Help","strArtist":"The
          Beatles","strArtistStripped":"The Beatles","intYearReleased":"1965","strStyle":"Rock/Pop","strGenre":"Rock
          & Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/xpuwpv1341915109.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/help-4ff33249471b5.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Help!
          is the title of the fifth British and tenth North American album by The Beatles,
          and the soundtrack from their film of the same name. Produced by George Martin
          for EMI''s Parlophone Records, it contains fourteen songs in its original
          British form, of which seven appeared in the film. These songs took up the
          first side of the vinyl album and included the singles \"Help!\" and \"Ticket
          to Ride\". The second side contained seven other releases including the most-covered
          song ever written, \"Yesterday\".\n\nThe American release was a true soundtrack
          album, mixing the first seven songs with orchestral material from the film.
          Of the other seven songs that were on the British release, two were released
          on the US version of the next Beatles album, Rubber Soul, two were back-to-back
          on the next US single and then appeared on Yesterday and Today, and three
          had already been on Beatles VI.\nIn 2012, Help! was voted 331st on Rolling
          Stone magazine''s list of the \"500 Greatest Albums of All Time\".","strDescriptionDE":null,"strDescriptionFR":"Help!
          est le cinqui\u00e8me album des Beatles, paru le 6 ao\u00fbt 1965 au Royaume-Uni,
          et une semaine plus tard aux \u00c9tats-Unis. Il est pr\u00e9par\u00e9 dans
          le cadre d''un deuxi\u00e8me film les mettant en vedette, \u00e9galement nomm\u00e9
          Help!. Les Fab Four l''enregistrent au cours de plusieurs sessions r\u00e9parties
          entre les concerts et les tournages, entre f\u00e9vrier et juin 1965. Ils
          se tournent de plus en plus vers le travail en studio, y r\u00e9p\u00e9tant
          directement les nouveaux titres en les enregistrant, multipliant les overdubs,
          approchant de nouveaux sons et de nouveaux instruments sur le chemin qui m\u00e8ne,
          plus tard dans l''ann\u00e9e, \u00e0 Rubber Soul, \u00e9tape majeure de leur
          carri\u00e8re discographique.\n\nAvec cet album, les Beatles entrent de plain-pied
          dans la musique pop. La face A de Help! comprend les chansons compos\u00e9es
          pour le film, notamment la chanson \u00e9ponyme et Ticket to Ride, parues
          en single. L''autre face contient pour sa part sept chansons absentes du long-m\u00e9trage,
          dont les deux derni\u00e8res reprises officiellement mises en bo\u00eete par
          le groupe, et Yesterday, enregistr\u00e9e par Paul McCartney, seul avec sa
          guitare et un quatuor \u00e0 cordes, produisant un des plus grands succ\u00e8s
          de l''histoire de la musique.\n\nL''album conna\u00eet un important succ\u00e8s
          critique et commercial, tr\u00f4nant neuf semaines en t\u00eate des hit-parades
          britanniques, apr\u00e8s y \u00eatre entr\u00e9 directement \u00e0 la premi\u00e8re
          place le jour de sa publication, avant de se maintenir 41 semaines dans les
          classements. La version publi\u00e9e aux \u00c9tats-Unis, d\u00e9sapprouv\u00e9e
          par les Beatles, est nettement diff\u00e9rente ; elle ne comprend en effet
          que les chansons de la face A, intercal\u00e9es entre des morceaux instrumentaux
          issus du film. Les autres chansons de l''album britannique se retrouvent sur
          les albums am\u00e9ricains Beatles VI, Rubber Soul et Yesterday and Today.
          Les titres de Help! sont donc r\u00e9partis sur quatre disques, qui sont autant
          de no 1 sur le march\u00e9 am\u00e9ricain.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Help!
          es el quinto \u00e1lbum brit\u00e1nico de los Beatles, y el noveno americano,
          al tiempo que banda sonora de su pel\u00edcula de mismo t\u00edtulo. Producido
          por George Martin para el sello discogr\u00e1fico subsidiario de EMI, Parlophone,
          el disco presentaba catorce canciones en su forma brit\u00e1nica original,
          de las cuales siete aparecieron en la pel\u00edcula Help!. Estas siete canciones
          ocuparon el primer lado del \u00e1lbum de vinilo. El segundo lado contuvo
          otras siete canciones que inclu\u00eda el tema m\u00e1s versionado jam\u00e1s
          escrito, \u00abYesterday\u00bb.\n\nLa edici\u00f3n americana se hab\u00eda
          convertido en una verdadera banda sonora de pel\u00edcula, al mezclar las
          primeras siete canciones con material orquestal de la pel\u00edcula. De las
          otras siete canciones, dos se publicar\u00edan en la versi\u00f3n estadounidense
          del siguiente \u00e1lbum de los Beatles, Rubber Soul; dos se editar\u00edan
          en un mismo disco sencillo americano, apareciendo despu\u00e9s en el \u00e1lbum
          Yesterday and Today; y tres aparecer\u00edan en Beatles VI.\n\nEn 2003, la
          revista Rolling Stone clasific\u00f3 Help! en el puesto 332 de su lista de
          los 500 mejores \u00e1lbumes de todos los tiempos.","strDescriptionPT":"Help!
          \u00e9 o quinto \u00e1lbum do grupo The Beatles, que teve tamb\u00e9m um lan\u00e7amento
          simult\u00e2neo de um filme com mesmo nome.\n\nLan\u00e7ado em agosto de 1965,
          no auge da beatlemania e das turn\u00eas do grupo, o \u00e1lbum reflete algumas
          mudan\u00e7as na m\u00fasica dos fab-four. Temos Lennon compondo ao estilo
          de Bob Dylan em \"You''ve Got To Hide Your Love Away\", a candidez de Harrison
          em \"I Need You\". Al\u00e9m do sucesso de \"Ticket To Ride\" e da m\u00fasica
          \"Help\" o \u00e1lbum ainda t\u00eam uma preciosidade: a m\u00fasica \"Yesterday\",
          nada menos que a can\u00e7\u00e3o mais regravada na hist\u00f3ria da m\u00fasica.","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"8.5","intScoreVotes":"2","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"0d44e1cb-c6e0-3453-8b68-4d2082f05421","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"mw0000189173","strBBCReviewID":"v34z","strRateYourMusicID":"help__f1","strDiscogsID":"45895","strWikidataID":"Q201816","strWikipediaID":"Help!_(album)","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2109688","idArtist":"111247","idLabel":"43827","strAlbum":"Something
          New","strAlbumStripped":"Something New","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1964","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/sxpxqp1347721757.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/something-new-55ba2ccc49e0e.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Something
          New is The Beatles'' third Capitol LP release, but fifth American album following
          the United Artists release of A Hard Day''s Night. This album includes eight
          songs from the original British release of A Hard Day''s Night, as well as
          the remaining tracks \"Slow Down\" and \"Matchbox\" from the Long Tall Sally
          EP and the German language version of \"I Want to Hold Your Hand\". It was
          released in mono and stereo, and all mono mixes of the five songs duplicated
          from the United Artists soundtrack album are the same. This was the first
          Capitol Beatles album with all of the tracks in \"true\" stereo. The mono
          release contains alternative versions of \"Any Time At All\" (a different
          mix during the instrumental bridge), \"I''ll Cry Instead\" (the \"missing\"
          third verse), \"When I Get Home\" (the line \"Till I walk out that door again\"
          during the song''s bridge has a different vocal passage from the UK mono mix),
          and \"And I Love Her\" (McCartney''s non-double-tracked vocal).\n\nThe album
          spent nine weeks at #2 on the Billboard 200, behind the United Artists A Hard
          Day''s Night album.\n\nThis album was also released on the Parlophone label
          for sale only on American Armed Forces bases in Europe. These copies have
          great collector value. The album was also issued in Germany on the Odeon label.
          The German stereo version contains a reprocessed stereo version of \"Komm,
          Gib Mir Deine Hand\" and an extended version of \"And I Love Her\", repeating
          the closing riff six times instead of four. This mix was later released on
          the US version of Rarities.\n\nIn 2004 this album was released for the first
          time on CD as part of The Capitol Albums, Volume 1 box set (catalogue number
          CDP 7243 8 66876 2 3).","strDescriptionDE":null,"strDescriptionFR":"Something
          New est un album du groupe britannique The Beatles, le 5e publi\u00e9 aux
          \u00c9tats-Unis. Ce disque ne contient que six pi\u00e8ces in\u00e9dites car
          I''ll Cry Instead, Tell Me Why, And I Love Her, I''m Happy Just to Dance with
          You et If I Fell avaient d\u00e9j\u00e0 \u00e9t\u00e9 publi\u00e9es un mois
          plus t\u00f4t, par le label United Artists, sur la trame sonore du film A
          Hard Day''s Night.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Something
          New es un \u00e1lbum de estudio de la banda brit\u00e1nica The Beatles publicado
          en Estados Unidos el 20 de julio de 1964. Fue el tercer disco editado por
          Capitol Records, pero el quinto \u00e1lbum estadounidense publicado despu\u00e9s
          de la banda sonora de la pel\u00edcula A Hard Day''s Night. Este disco inclu\u00eda
          ocho canciones originales del \u00e1lbum brit\u00e1nico A Hard Day''s Night
          as\u00ed como los temas \"Slow Down\" y \"Matchbox\", del EP Long Tall Sally,
          y la versi\u00f3n alemana de \"I Want to Hold Your Hand\", titulada \"Komm,
          Gib Mir Deine Hand\". El lanzamiento en mono conten\u00eda las versiones alternativas
          de \"Any Time at All\", \"I''ll Cry Instead\" (el tercer verso \"perdido\"),
          \"When I Get Home\" y \"And I Love Her\" (el solo vocal por McCartney grabado
          a una sola pista).\n\nEl \u00e1lbum estuvo nueve semanas en el n\u00ba 2 de
          Billboard, por detr\u00e1s de la banda sonora de United Artists A Hard Day''s
          Night.\n\nEste \u00e1lbum fue lanzado tambi\u00e9n bajo la etiqueta de Parlophone
          para ser vendido exclusivamente a las Fuerzas Armadas Americanas estacionadas
          en Europa. Con el tiempo, estos \u00e1lbumes llegaron a tener gran valor entre
          los coleccionistas de discos. Something New fue editado, asimismo, bajo etiqueta
          de Odeon en Alemania. La versi\u00f3n alemana conten\u00eda la versi\u00f3n
          in\u00e9dita de \"And I Love Her\", que despu\u00e9s se publicar\u00eda en
          la versi\u00f3n estadounidense del disco recopilatorio Rarities.\n\nEn 2004,
          este \u00e1lbum fue lanzado por primera vez en CD en The Capitol Albums Vol.
          1, que conten\u00eda asimismo los discos Meet the Beatles!, The Beatles''
          Second Album y Beatles ''65.","strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"8","intScoreVotes":"1","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"451e7aa4-a782-3979-9aa0-98c03a246fe9","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":"46151","strWikidataID":"Q1929530","strWikipediaID":"Something_New_(album)","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2109691","idArtist":"111247","idLabel":"43827","strAlbum":"Revolver","strAlbumStripped":"Revolver","strArtist":"The
          Beatles","strArtistStripped":"The Beatles","intYearReleased":"1966","strStyle":"Rock/Pop","strGenre":"Rock
          & Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/ttsuyw1341915238.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/revolver-4fd2794d4f980.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Revolver
          is the seventh studio album by the English rock band The Beatles, released
          on 5 August 1966 on the Parlophone label and produced by George Martin. Many
          of the tracks on Revolver are marked by an electric guitar-rock sound, in
          contrast with their previous LP, the folk rock inspired Rubber Soul (1965).
          In Britain, the fourteen tracks from Revolver were released to radio stations
          throughout July 1966, \"building anticipation for what would clearly be a
          radical new phase in the group''s recording career\".\n\nIt reached number
          one on both the British chart and American chart and stayed at the top spot
          for seven weeks and six weeks, respectively. The album was remastered 9 September
          2009 for the first time since its 1987 digital compact disc release. Placed
          at number 1 in the All-Time Top 1000 Albums and number 3 in the Rolling Stone
          magazine''s list of the 500 greatest albums of all time, the album is often
          regarded as one of the greatest achievements in music history and one of The
          Beatles'' greatest studio achievements.","strDescriptionDE":null,"strDescriptionFR":"Revolver
          est le septi\u00e8me album des Beatles, paru le 5 ao\u00fbt 1966 au Royaume-Uni
          et trois jours plus tard aux \u00c9tats-Unis, avec une liste de chansons l\u00e9g\u00e8rement
          diff\u00e9rente. Enregistr\u00e9 sur une p\u00e9riode de trois mois, cet album
          est souvent consid\u00e9r\u00e9 comme un album majeur de leur carri\u00e8re
          et l''un des plus influents de tous les temps par les critiques, figurant
          entre autres \u00e0 la troisi\u00e8me place dans la liste des 500 plus grands
          albums de tous les temps du magazine Rolling Stone.\n\nDans la continuit\u00e9
          de Rubber Soul, Revolver marque un tournant capital dans le style musical
          des Beatles. D\u00e9laissant leur image de \u00ab bons gar\u00e7ons \u00bb,
          les Beatles marquent avec cet album le d\u00e9but de l''\u00e8re psych\u00e9d\u00e9lique.
          Leur cr\u00e9ativit\u00e9 artistique explose alors et sera confirm\u00e9e
          avec l''album suivant, Sgt. Pepper''s Lonely Hearts Club Band, en 1967.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Revolver
          es el s\u00e9ptimo \u00e1lbum de The Beatles, habi\u00e9ndose lanzado a la
          venta el 5 de agosto de 1966. El \u00e1lbum present\u00f3 varios nuevos desarrollos
          estil\u00edsticos que llegar\u00edan a ser m\u00e1s pronunciados en discos
          posteriores. Logr\u00f3 llegar al n\u00famero uno en la lista de \u00e9xitos
          de Gran Breta\u00f1a.\n\nRevolver fue el disco que marc\u00f3 la carrera del
          grupo como psicod\u00e9lica. Con grandes contrastes como \"Taxman\" (rock
          \u00e1cido), \"Tomorrow Never Knows\" (rock psicod\u00e9lico) y \"Eleanor
          Rigby\" (con un cuarteto de cuerdas). Revolver es citado frecuentemente como
          uno de los mejores \u00e1lbumes de la historia de la m\u00fasica pop. En 1997
          fue seleccionado en el tercer puesto de los mejores \u00e1lbumes de todos
          los tiempos en una votaci\u00f3n de Music of the Millennium dirigida en el
          Reino Unido por prestigiosos medios, como son HMV, Channel, The Guardian y
          Classic FM. En febrero de 1998 los lectores de la Q magazine colocaron al
          \u00e1lbum en el segundo lugar,4 mientras que en el a\u00f1o 2001, la cadena
          de televisi\u00f3n VH1 lo situ\u00f3 en el primer puesto de entre los mejores
          100 \u00e1lbumes de todos los tiempos. Revolver fue tambi\u00e9n votado como
          mejor \u00e1lbum en el Virgin All Time Top 1,000 Albums. Una cr\u00edtica
          de PopMatters describi\u00f3 el \u00e1lbum como \"[la obra] de la banda m\u00e1s
          grande de la historia de la m\u00fasica popular, cuyos miembros alcanzaron
          su punto m\u00e1s alto a nivel musical en el tiempo exacto\", mientras que
          la revista Ink Blot afirmaba que el \u00e1lbum \"se mantiene en la cumbre
          de la m\u00fasica popular occidental\".\n\nEn 2003, Rolling Stone lo coloc\u00f3
          en el puesto 3 de su lista de los 500 mejores \u00e1lbumes de todos los tiempos.","strDescriptionPT":"Revolver
          \u00e9 o s\u00e9timo \u00e1lbum do grupo de rock ingl\u00eas The Beatles lan\u00e7ado
          em 5 de agosto de 1966, inicialmente no Reino Unido e em 8 de agosto nos EUA.
          Atingiu o primeiro lugar nas paradas de sucesso americana e inglesa. Este
          \u00e1lbum est\u00e1 na lista dos 200 \u00e1lbuns definitivos no Rock and
          Roll Hall of Fame.\n\nConsiderado ainda mais inovador do que seu antecessor
          (Rubber Soul, de 1965), Revolver marca a ades\u00e3o oficial dos Beatles ao
          Psicodelismo. Passeia desde a m\u00fasica oriental \"Love You To\", aos apelos
          vibrantes de \"Got to Get You into My Life\", da solid\u00e3o l\u00fagubre
          de \"Eleanor Rigby\", ao experimentalismo psicod\u00e9lico de \"Tomorrow Never
          Knows\" e o ufanismo de \"Yellow Submarine\". Nesta, particularmente, a chave
          da nova \"abertura\": \"Vamos vivendo uma bela vida/Achamos para tudo uma
          sa\u00edda/C\u00e9u azul, mar verde e belo/Em nosso submarino amarelo\". Com
          os Beatles, o mundo embarcaria no submarino amarelo da fantasia, pronto para
          viver toda a loucura dos \u00faltimos anos da d\u00e9cada.","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"9.5","intScoreVotes":"4","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"72d15666-99a7-321e-b1f3-a3f8c09dff9f","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"revolver-mw000018917","strBBCReviewID":"xz25","strRateYourMusicID":"revolver","strDiscogsID":"45284","strWikidataID":"Q185121","strWikipediaID":"Revolver_(Beatles_album)","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2109694","idArtist":"111247","idLabel":"43827","strAlbum":"Abbey
          Road","strAlbumStripped":"Abbey Road","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1969","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"14300000","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/vtqrqs1341917034.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":"https://www.theaudiodb.com/images/media/album/thumbback/uqvtvt1569747232.jpg","strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/abbey-road-4fd2caf0f1ceb.png","strAlbumSpine":null,"strAlbum3DCase":"https://www.theaudiodb.com/images/media/album/3dcase/rprrrw1569747253.png","strAlbum3DFlat":"https://www.theaudiodb.com/images/media/album/3dflat/wuxtsx1569747141.png","strAlbum3DFace":"https://www.theaudiodb.com/images/media/album/3dface/rrxrvu1569747151.png","strAlbum3DThumb":"https://www.theaudiodb.com/images/media/album/3dthumb/yvyqpp1569747289.png","strDescriptionEN":"Abbey
          Road is the 11th studio album released by the English rock band The Beatles.
          It is their last recorded album, although Let It Be was the last album released
          before the band''s dissolution in 1970. Work on Abbey Road began in April
          1969, and the album was released on 26 September 1969 in the United Kingdom,
          and 1 October 1969 in the United States.\n\nAbbey Road is widely regarded
          as one of The Beatles'' most tightly constructed albums, although the band
          was barely operating as a functioning unit at the time. In 2012, Abbey Road
          was voted 14th on Rolling Stone magazine''s list of the \"500 Greatest Albums
          of All Time\". In 2009, readers of the magazine also named Abbey Road the
          greatest Beatles album","strDescriptionDE":null,"strDescriptionFR":"Abbey
          Road est le onzi\u00e8me album original publi\u00e9 par les Beatles, paru
          le 26 septembre 1969 au Royaume-Uni, et le 1er octobre aux \u00c9tats-Unis.
          Bien que sa sortie pr\u00e9c\u00e8de celle de Let It Be, paru en mai 1970,
          il est le dernier album enregistr\u00e9 par les Fab Four. Le 20 ao\u00fbt
          1969, les quatre Beatles sont r\u00e9unis pour la toute derni\u00e8re fois
          en studio et, vers la fin de septembre, au moment o\u00f9 le disque para\u00eet,
          John Lennon met fin au groupe en lui annon\u00e7ant son d\u00e9part d\u00e9finitif.
          La s\u00e9paration des Beatles n''est toutefois officialis\u00e9e qu''en avril
          1970.\n\nApr\u00e8s l''\u00e9chec des sessions du projet Get Back en janvier
          1969, Paul McCartney, au nom de tout le groupe, contacte le producteur George
          Martin pour lui proposer d''enregistrer un album \u00ab comme avant \u00bb.
          Apr\u00e8s quelques enregistrements effectu\u00e9s entre f\u00e9vrier et mai
          1969, les quatre Beatles se r\u00e9unissent une derni\u00e8re fois aux studios
          EMI de Londres (qui seront renomm\u00e9s plus tard les studios Abbey Road),
          en juillet et ao\u00fbt 1969, pour mettre en bo\u00eete une collection de
          chansons dont la plupart avaient \u00e9t\u00e9 compos\u00e9es, r\u00e9p\u00e9t\u00e9es
          et/ou enregistr\u00e9es sous forme de d\u00e9mos \u00e0 l''\u00e9poque de
          l''album blanc et du projet Get Back, toutes retravaill\u00e9es pour l''occasion.\n\nAbbey
          Road se distingue avec un medley d''un quart d''heure, pr\u00e9sentant huit
          chansons plus ou moins compl\u00e8tes qui s''encha\u00eenent les unes apr\u00e8s
          les autres, sur sa seconde face. L''album confirme \u00e9galement le talent
          d''auteur-compositeur du guitariste George Harrison, qui propose deux de ses
          plus fameuses compositions avec les Beatles, et popularise l''utilisation
          du synth\u00e9tiseur (en l''occurrence un Moog) dans le rock. La pochette
          du disque reste une des plus c\u00e9l\u00e8bres de l''histoire de la musique,
          repr\u00e9sentant les Beatles traversant un passage pi\u00e9ton au croisement
          de Grove End Road et Abbey Road, face aux studios o\u00f9 ils ont enregistr\u00e9
          presque toutes leurs chansons depuis 1962.\n\nCit\u00e9 comme un album particuli\u00e8rement
          bien produit et remarquablement construit, un des plus influents aussi, \u00e0
          commencer par sa pochette, Abbey Road est un immense succ\u00e8s commercial,
          avec 30 millions d''exemplaires vendus dans le monde, soit la deuxi\u00e8me
          meilleure vente du groupe apr\u00e8s Sgt. Pepper''s Lonely Hearts Club Band.
          Quarante ans apr\u00e8s sa sortie, la popularit\u00e9 d''Abbey Road ne se
          d\u00e9ment pas, puisque c''est cet album qui devance toutes les \u0153uvres
          du groupe au sommet des hit-parades \u00e0 travers la plan\u00e8te \u00e0
          l''occasion de la r\u00e9\u00e9dition de tout le catalogue remasteris\u00e9
          en septembre 2009.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Abbey
          Road es el und\u00e9cimo \u00e1lbum de estudio publicado por la banda brit\u00e1nica
          de rock The Beatles, considerada por muchos su obra cumbre, pues fue el \u00faltimo
          disco de estudio de la banda, editado en el a\u00f1o 1969. Las grabaciones
          de Abbey Road comenzaron en abril de 1969, haciendo de este el \u00faltimo
          \u00e1lbum grabado por la banda, ya que Let It Be, lanzado en 1970, hab\u00eda
          sido grabado con anterioridad. Fue lanzado el 26 de septiembre de 1969 en
          el Reino Unido, y el 1 de octubre del mismo a\u00f1o en los Estados Unidos.\n\nEl
          \u00e1lbum fue producido y orquestado por George Martin, con Geoff Emerick
          como ingeniero de grabaci\u00f3n y Tony Banks como operador de cinta. Particip\u00f3
          tambi\u00e9n, como asistente de grabaci\u00f3n, Alan Parsons.\n\nEl \u00e1lbum
          se caracteriz\u00f3 por la presencia de un medley en el lado B, una larga
          pieza de 16 minutos, que constaba de ocho canciones enlazadas una tras otra
          sucesivamente. El \u00e1lbum destac\u00f3 tambi\u00e9n por contener dos de
          las canciones m\u00e1s conocidas del guitarrista George Harrison, \"Something\"
          y \"Here Comes the Sun\", popularizando \u00e9sta \u00faltima el uso del sintetizador
          (Moog) en el rock. La portada del \u00e1lbum se convirti\u00f3 en una de las
          m\u00e1s famosas de la historia de la m\u00fasica, en la cual se representaba
          a The Beatles cruzando un paso peatonal en el cruce de Grove End Road con
          la calle Abbey Road, frente a los estudios donde se grabaron casi todas sus
          canciones desde 1962.\n\nEst\u00e1 considerado uno de los \u00e1lbumes mejor
          elaborados por The Beatles, aunque la banda apenas funcionaba ya como un grupo
          unido en esa \u00e9poca. En 2003, ocup\u00f3 el puesto n.\u00b0 14 en la lista
          realizada por la revista Rolling Stone de Los 500 mejores \u00e1lbumes de
          todos los tiempos. Es uno de los seis \u00e1lbumes certificados con disco
          de diamante de The Beatles, lo que los convierte en los m\u00e1ximos ganadores
          de este reconocimiento en la historia de la m\u00fasica. Los otros \u00e1lbumes
          con disco de diamante son The Beatles/1962-1966, The Beatles/1967-1970, The
          Beatles, Sgt. Pepper''s Lonely Hearts Club Band y 1.","strDescriptionPT":"Abbey
          Road foi o 12\u00b0 \u00e1lbum lan\u00e7ado pela banda brit\u00e2nica The
          Beatles. Foi lan\u00e7ado em 26 de setembro de 1969, e leva o mesmo nome da
          rua de Londres onde situa-se o est\u00fadio Abbey Road. Foi produzido e orquestrado
          por George Martin para a Apple Records. Este \u00e1lbum est\u00e1 na lista
          dos 200 \u00e1lbuns definitivos no Rock and Roll Hall of Fame.\n\nApesar de
          ter sido o pen\u00faltimo \u00e1lbum lan\u00e7ado pela banda, foi o \u00faltimo
          a ser gravado. As m\u00fasicas do \u00faltimo disco lan\u00e7ado pelos Beatles,
          Let It Be, foram gravadas alguns meses antes das sess\u00f5es que deram origem
          a Abbey Road. O \u00e1lbum \u00e9 considerado um dos melhores do grupo e parecia
          que os momentos de turbul\u00eancias tinham passado e tudo havia voltado ao
          normal entre eles, mas na verdade o maior problema da banda come\u00e7ou a
          esquentar: Guerra de poderes. Ap\u00f3s a morte de Brian Epstein, Paul McCartney
          sugeriu que Lee Eastman, advogado de sucesso e pai de Linda Eastman, tomasse
          conta dos neg\u00f3cios mas os outros Beatles desconfiando e visando uma prote\u00e7\u00e3o
          maior ao legado de todos sugeriram que Allen Klein, (que era promotor dos
          Stones e j\u00e1 vinha tentando \"roubar\" os Beatles de Epstein h\u00e1 muito
          tempo), era a melhor op\u00e7\u00e3o pelo seu jeito convicto de \"homem das
          ruas\". McCartney n\u00e3o concordou por achar absurdo pagar 15% de todos
          os lucros para Klein. Ap\u00f3s a separa\u00e7\u00e3o da banda, Eastman foi
          advogado da carreira solo de Paul e Allen Klein foi a justi\u00e7a por ter
          roubado uma m\u00e9dia de 5 milh\u00f5es dos Beatles. O restante dos Beatles
          mantiveram contrato com Klein at\u00e9 1977.\n\nGeorge Martin produziu e orquestrou
          o disco junto com Geoff Emerick como engenheiro de som, Alan Parsons como
          assistente de som e Tony Banks como operador de fitas. Martin considera Abbey
          Road o melhor disco que os Beatles fizeram. E n\u00e3o \u00e9 por menos: ele
          \u00e9 o mais bem acabado de todos, um dos mais cuidadosamente produzidos
          (compar\u00e1vel somente a Sgt. Pepper''s Lonely Hearts Club Band). Sua estrutura
          foi bastante pensada e discutida, e as vis\u00f5es discordantes dos integrantes
          da banda s\u00f3 contribu\u00edram para a riqueza da cria\u00e7\u00e3o final.\n\nTamb\u00e9m
          foi em Abbey Road que George Harrison se firmou como um compositor de primeira
          linha. Ap\u00f3s anos vivendo sob a sombra de John Lennon e McCartney, ele
          finalmente emplacou dois grandes sucessos com este \u00e1lbum: \"Here Comes
          the Sun\" e \"Something\". Ambas foram regravadas incessantemente ao longo
          dos anos, sendo que Something chegou a ser apontada pela revista Time como
          \"a melhor m\u00fasica do disco\" e como a segunda m\u00fasica mais interpretada
          no mundo, atr\u00e1s somente de \"Yesterday\", tamb\u00e9m dos Beatles.\n\nEste
          disco foi marcado pelo uso de novos recursos tecnol\u00f3gicos que estavam
          surgindo na \u00e9poca. Um deles foi o sintetizador Moog, que come\u00e7ava
          a ser utilizado em maior escala dentro do rock. Ele possibilitava que virtualmente
          qualquer som fosse gerado eletronicamente. O Moog pode ser notado claramente
          em m\u00fasicas como \"Here Comes the Sun\", \"Maxwell''s Silver Hammer\"
          e \"Because\". Por seu trabalho em Abbey Road, os engenheiros de som Geoff
          Emerick e Phillip McDonald ganharam o Grammy.","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"9.5","intScoreVotes":"4","strReview":"At
          the fag end of the 60s, the Beatles produced Abbey Road, their last smoke
          and mirrors triumph, a musical truce that papered over cracks between the
          group which were, by now, unfathomably deep. It was to be a marvellous set-piece
          finale for the group that had defined the decade.\nAlthough large sections
          of the material had been left over from as far back as their Indian sojourn
          in the spring of 1968, the overall sound and feel was that of a coherent and
          logical work, which played to every one of the foursome''s considerable strengths.\nJohn
          Lennon would frequently dismiss the album after its release, but Abbey Road
          contains three of his very finest works: Come Together, I Want You (She''s
          So Heavy), and Because. George Harrison established himself as an individual
          talent of some note with the beautiful Something and the ever-lovely Here
          Comes the Sun, and even Ringo Starr continued to set fair his light entertainer
          course with Octopus''s Garden.\nHowever \u2013 the deplorable Maxwell''s Silver
          Hammer aside \u2013 Abbey Road is primarily a triumph for Paul McCartney,
          preserving The Beatles'' legacy on their less-than-fond farewell. Apart from
          being fairly low-key on the album''s first side, his piecing together of their
          ''long medley'' from leftovers and doodles on the reverse is possibly his
          greatest sustained achievement, culminating in every member of the group soloing
          on The End. Although this side is responsible for myriad crimes later committed
          in its name (think the worst of 10cc, ELO, Alan Parsons Project), it is a
          mature and intelligent coda to the single most important act British music
          produced.\nThe Beatles\u2019 work was done. They''d come to symbolise the
          60s, taken youth culture to the world, and ultimately collapsed under the
          responsibility, the weight they had to carry. Abbey Road is the soundtrack
          to it all.","strMood":"Happy","strTheme":null,"strSpeed":"Medium","strLocation":null,"strMusicBrainzID":"9162580e-5df4-32de-80cc-f45a8d8a9b1d","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"abbey-road-mw0000192","strBBCReviewID":"cwvr","strRateYourMusicID":"abbey_road","strDiscogsID":"24047","strWikidataID":"Q173643","strWikipediaID":"Abbey_Road","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2109696","idArtist":"111247","idLabel":"43827","strAlbum":"Sgt.
          Pepper''s Lonely Hearts Club Band","strAlbumStripped":"Sgt Peppers Lonely
          Hearts Club Band","strArtist":"The Beatles","strArtistStripped":"The Beatles","intYearReleased":"1967","strStyle":"Rock/Pop","strGenre":"Rock
          & Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"32000000","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/uryxqr1341915333.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":"https://www.theaudiodb.com/images/media/album/thumbback/wwuprw1571230427.jpg","strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/sgt-peppers-lonely-hearts-club-band-4fd28bf62f9eb.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Sgt.
          Pepper''s Lonely Hearts Club Band is the eighth studio album by the English
          rock band The Beatles. Released on 1 June 1967 on the Parlophone label, and
          produced by George Martin, the album is widely regarded as one of the greatest
          of all time. Including songs such as \"Lucy in the Sky with Diamonds\" and
          \"A Day in the Life\", the LP was recorded over a 129-day period beginning
          in December 1966. During the Sgt. Pepper sessions, the band improved upon
          their production quality, and explored experimental recording techniques.
          Martin''s innovative, and lavish production included the use of an orchestra.
          The songs on the album range from music hall, rock and roll, pop rock, and
          traditional Indian music. The album''s cover idea was sketched by McCartney,
          and then designed and executed by English pop artists Peter Blake and Jann
          Haworth. It depicts the band posing in front of a collage of some of their
          favourite celebrities, and has been widely acclaimed and imitated.\n\nSgt.
          Pepper was a worldwide critical and commercial success, spending a total of
          27 weeks at the top of the UK Album Chart and 15 weeks at number one on the
          US Billboard 200. A defining album in the emerging psychedelic rock style,
          the album was critically acclaimed upon release and won four Grammy Awards
          in 1968. It frequently ranks at or near the top of published lists of the
          greatest albums of all time. In 1994, it was ranked number one in the book
          All Time Top 1000 Albums. In 2003, and again in 2012, the album was placed
          at number one on Rolling Stone magazine''s list of \"The 500 Greatest Albums
          of All Time\". Sgt. Pepper is one of the world''s best selling albums; 32
          million copies have been shipped","strDescriptionDE":null,"strDescriptionFR":"Sgt.
          Pepper''s Lonely Hearts Club Band est le huiti\u00e8me album des Beatles.
          Cet album est souvent cit\u00e9 comme leur plus grande \u0153uvre et l''un
          des albums les plus influents de tous les temps par les critiques, figurant
          entre autres \u00e0 la premi\u00e8re place dans la liste des 500 plus grands
          albums de tous les temps du magazine Rolling Stone. Enregistr\u00e9 par les
          Beatles sur une p\u00e9riode de 129 jours, l''album est sorti le 1er juin
          1967 en Grande-Bretagne et le jour suivant aux \u00c9tats-Unis.\n\nPar son
          retentissement, par la fa\u00e7on dont il a r\u00e9volutionn\u00e9 l''industrie
          du disque, par sa dur\u00e9e de vie dans les hit-parades, par la force avec
          laquelle il a capt\u00e9 l''air de son temps \u2014 il fut la \u00ab bande
          sonore \u00bb du Summer of Love \u2014, Sgt. Pepper reste encore \u00e0 ce
          jour une pierre angulaire de l''histoire de la musique et de la culture populaire
          de la seconde moiti\u00e9 du XXe si\u00e8cle.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Sgt.
          Pepper''s Lonely Hearts Club Band es el octavo \u00e1lbum de estudio de la
          banda brit\u00e1nica The Beatles. Es a menudo citado por la cr\u00edtica como
          una de sus mejores obras y uno de los discos m\u00e1s influyentes de todos
          los tiempos, apareciendo en el primer lugar de la lista de los 500 mejores
          \u00e1lbumes de todos los tiempos en la revista Rolling Stone. Tambi\u00e9n
          fue seleccionado como el mejor \u00e1lbum de rock de todos los tiempos por
          el sitio de Internet Digital Dream Door en su lista \u00ab100 Greatest Rock
          Albums\u00bb. Se grab\u00f3 en un periodo de 129 d\u00edas, y fue lanzado
          el 26 de mayo de 1967 en el Reino Unido (cinco d\u00edas antes de la fecha
          prevista, el 1 de junio de 1967) y el 2 de junio en Estados Unidos.\n\nInmediatamente
          despu\u00e9s de salir a la venta, se convirti\u00f3 en una sensaci\u00f3n
          popular. Innovador en muchos sentidos, desde la estructura hasta las t\u00e9cnicas
          de grabaci\u00f3n, influy\u00f3 en casi todos los trabajos de los g\u00e9neros
          pop y rock que se hicieron despu\u00e9s. Es uno de los seis \u00e1lbumes certificados
          con disco de diamante de The Beatles, lo que los convierte en los m\u00e1ximos
          ganadores de este reconocimiento en la historia de la m\u00fasica. Los otros
          \u00e1lbumes con disco de diamante son The Beatles/1962-1966, The Beatles,
          Abbey Road, The Beatles/1967-1970 y 1. En 1968 gan\u00f3 el Premio Grammy
          a Mejor \u00c1lbum del a\u00f1o.","strDescriptionPT":"Sgt. Pepper''s Lonely
          Hearts Club Band \u00e9 o oitavo \u00e1lbum lan\u00e7ado pela banda brit\u00e2nica
          de rock The Beatles. \u00c9 frequentemente citado como o melhor e mais influente
          \u00e1lbum da hist\u00f3ria do rock e da m\u00fasica. Gravado em 129 dias
          em aproximadamente 700 horas, foi lan\u00e7ado em 1 de junho de 1967 na Inglaterra,
          e no dia seguinte nos Estados Unidos. Considerado como \u00e1lbum inovador
          desde sua t\u00e9cnica de grava\u00e7\u00e3o at\u00e9 a elabora\u00e7\u00e3o
          da capa. Pelo pouco apelo comercial, n\u00e3o foi tocado nas r\u00e1dios,
          mas vendeu 11 milh\u00f5es de c\u00f3pias s\u00f3 nos Estados Unidos. Em 2003,
          a revista especializada em m\u00fasica Rolling Stone colocou Sgt. Pepper''s
          no primeiro lugar de uma lista dos 200 \u00e1lbuns definitivos no Rock and
          Roll Hall of Fame.\n\nDois dos maiores sucessos da banda, Strawberry Fields
          Forever e Penny Lane, estariam em Sgt.Pepper\u00b4s, mas foram lan\u00e7ados
          como um compacto. O disco recebeu quatro Grammys, entre eles \"\u00c1lbum
          do Ano\".","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"9.4","intScoreVotes":"7","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"Medium","strLocation":null,"strMusicBrainzID":"9f7a4c28-8fa2-3113-929c-c47a9f7982c3","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"mw0000649874","strBBCReviewID":"5dcz","strRateYourMusicID":"sgt__peppers_lonely_hearts_clu","strDiscogsID":"23934","strWikidataID":"Q169226","strWikipediaID":"Sgt._Pepper''s_Lonely_Hearts_Club_Band","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2117303","idArtist":"111247","idLabel":"43827","strAlbum":"Please
          Please Me","strAlbumStripped":"Please Please Me","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1963","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/please-please-me-4ddaafee1d6c3.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/please-please-me-4fd2526f52918.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Please
          Please Me is the debut album by English rock band The Beatles. Parlophone
          rush-released the album on 22 March 1963 in the United Kingdom to capitalise
          on the success of singles \"Please Please Me\" (No.1 on most lists but only
          No. 2 on Record Retailer) and \"Love Me Do\" (No.17).\n\nOf the album''s fourteen
          songs, eight were written by Lennon-McCartney (originally credited \"McCartney-Lennon\"),
          early evidence of what Rolling Stone later called \"[their invention of] the
          idea of the self-contained rock band, writing their own hits and playing their
          own instruments\". In 2012, Please Please Me was voted 39th on Rolling Stone
          magazine''s list of the \"500 Greatest Albums of All Time\".\n\nIn order for
          the album to contain fourteen songs (the norm for British 12\" vinyl pop albums
          at that time was to have seven songs on each side, while American albums usually
          had only five or six songs per side) ten more tracks were needed to add to
          the four sides of their first two singles recorded and released previously.
          Therefore, at 10:00 am on Monday, 11 February 1963, The Beatles and George
          Martin started recording what was essentially their live act in 1963, and
          finished 585 minutes later (9 hours and 45 minutes). In three sessions that
          day (each lasting approximately three hours) they produced an authentic representation
          of the band''s Cavern Club-era sound, as there were very few overdubs and
          edits. Optimistically, only two sessions were originally booked by Martin-the
          evening session was added later. Martin initially contemplated recording the
          album live at the Cavern in front of the group''s home audience and visited
          the Liverpool club on 9 December 1962 to consider the technicalities. But
          when time constraints intervened, he decided to book them at EMI Studios in
          Abbey Road instead and record them virtually live. Martin said, \"It was a
          straightforward performance of their stage repertoire - a broadcast, more
          or less.\"","strDescriptionDE":null,"strDescriptionFR":"Please Please Me est
          le premier album des Beatles, paru le 22 mars 1963 au Royaume-Uni. Sa publication
          accompagne les d\u00e9buts de la Beatlemania, apr\u00e8s la sortie des deux
          premiers singles du groupe, Love Me Do en octobre 1962, suivi quatre mois
          plus tard de leur premier succ\u00e8s au sommet des hit-parades, la chanson
          Please Please Me. Outre les quatre titres figurant sur ces singles, l''album
          contient dix chansons enregistr\u00e9es le 11 f\u00e9vrier 1963 aux studios
          EMI d''Abbey Road, lors d''une session d''enregistrement \u00ab marathon \u00bb
          de 585 minutes, dans des conditions relevant du direct.\n\nL''album est compos\u00e9
          de huit chansons \u00e9crites par John Lennon et Paul McCartney, et de six
          reprises de standards appr\u00e9ci\u00e9s des membres du groupe et faisant
          partie de leur r\u00e9pertoire sc\u00e9nique. Si la plupart des chansons sont
          chant\u00e9es par Lennon et McCartney, seuls ou en duo, George Harrison participe
          aux ch\u0153urs et pr\u00eate sa voix sur deux morceaux, tandis que Ringo
          Starr en interpr\u00e8te une. Les quatorze titres sont typiques du r\u00e9pertoire
          que le groupe joue depuis plusieurs ann\u00e9es dans les clubs de Liverpool
          et de Hambourg. La pochette est illustr\u00e9e d''une photographie des quatre
          musiciens prise dans la cage d''escaliers du si\u00e8ge de la compagnie EMI
          \u00e0 Londres, parodi\u00e9e par le groupe lui-m\u00eame six ans plus tard.\n\n\u00c0
          partir de la sortie de Please Please Me, les Beatles ne cessent de monter
          en popularit\u00e9, en Grande-Bretagne d''abord, aux \u00c9tats-Unis ensuite,
          puis dans le monde entier. L''album s''installe pour plus de sept mois \u00e0
          la premi\u00e8re place des hit-parades britanniques. S''il n''est pas l''album
          du groupe le plus appr\u00e9ci\u00e9 par la critique, ni celui qui s''est
          le mieux vendu, il conserve un statut particulier dans leur discographie pour
          son authenticit\u00e9, sa fra\u00eecheur et son r\u00f4le de pr\u00e9curseur.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Please
          Please Me fue el primer \u00e1lbum grabado por los Beatles, editado el 22
          de marzo de 1963 en el Reino Unido. Su publicaci\u00f3n acompa\u00f1a el inicio
          de la Beatleman\u00eda, despu\u00e9s del \u00e9xito de los sencillos \u00abPlease
          Please Me\u00bb (n\u00ba 1 en varias listas musicales inglesas, pero solo
          n\u00ba 2 en el Record Retailer ) y \u00abLove Me Do\u00bb (n\u00ba 17 en
          el Record Retailer). Adem\u00e1s de los cuatro t\u00edtulos en los singles,
          el \u00e1lbum contiene diez canciones grabadas el d\u00eda 11 febrero de 1963
          en los estudios EMI de Abbey Road, durante una sesi\u00f3n de grabaci\u00f3n
          de \"marat\u00f3n\" de 585 minutos. El disco contiene ocho canciones que fueron
          compuestas por John Lennon y Paul McCartney, temprana evidencia de lo que
          Rolling Stone denomin\u00f3 posteriormente como \u00ab[la invenci\u00f3n por
          parte de ellos] de la idea de un grupo de m\u00fasica rock hecho a s\u00ed
          mismo, escribiendo sus propios \u00e9xitos y tocando sus propios instrumentos
          musicales\u00bb. Aunque la mayor parte de las canciones fueran cantadas por
          Lennon o McCartney, solos o en d\u00fao, George Harrison participa en el coro
          y presta su voz para dos canciones, mientras que Ringo Starr es int\u00e9rprete
          de una. Los catorce temas son t\u00edpicos del repertorio que la banda tocaba
          durante a\u00f1os en clubes de Liverpool y Hamburgo. La cubierta est\u00e1
          ilustrada con una fotograf\u00eda de los cuatro en las escaleras de la sede
          de la compa\u00f1\u00eda EMI en Londres, parodiada por el grupo seis a\u00f1os
          despu\u00e9s. Desde el lanzamiento de Please Please Me, los Beatles aumentaron
          su popularidad en todo el mundo, principalmente en el Reino Unido, donde el
          \u00e1lbum lleg\u00f3 al puesto n\u00famero 1 el d\u00eda 11 de mayo de 1963,
          permaneciendo en ese puesto durante 30 semanas hasta el 7 de diciembre de
          1963, fecha en la que fue sustituido en la primera posici\u00f3n por el segundo
          LP del grupo, With the Beatles.","strDescriptionPT":"Please Please Me \u00e9
          o primeiro \u00e1lbum gravado em est\u00fadio e lan\u00e7ado pelos Beatles,
          em 22 de mar\u00e7o de 1963. O \u00e1lbum cont\u00e9m 14 can\u00e7\u00f5es,
          oito escritas por Lennon/McCartney. Em 2003, a revista Rolling Stone listou
          o \u00e1lbum no n\u00famero 39 na lista de 500 melhores \u00e1lbuns de todos
          os tempos. A Rolling Stone tamb\u00e9m colocou as can\u00e7\u00f5es \"I Saw
          Her Standing There\" (em #130) e \"Please Please Me\" (#184) na lista de 500
          melhores can\u00e7\u00f5es de todos os tempos.\n\nNos Estados Unidos, a maioria
          das can\u00e7\u00f5es de Please Please Me foram lan\u00e7adas no \u00e1lbum
          da Vee-Jay Records chamado Introducing... The Beatles em 1964, e depois no
          \u00e1lbum da Capitol Records chamado The Early Beatles em 1965. O \u00e1lbum
          Please Please Me n\u00e3o foi lan\u00e7ado neste pa\u00eds at\u00e9 a padroniza\u00e7\u00e3o
          mundial do cat\u00e1logo dos Beatles.","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"6","intScoreVotes":"3","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"de208292-8db5-3aed-a14a-b37a84d8c521","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"mw0000649873","strBBCReviewID":"6jwx","strRateYourMusicID":"please_please_me","strDiscogsID":"45362","strWikidataID":"Q181826","strWikipediaID":"Please_Please_Me","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2117304","idArtist":"111247","idLabel":"43827","strAlbum":"With
          The Beatles","strAlbumStripped":"With The Beatles","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1963","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/with-the-beatles-4fd2528f3f247.JPG","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/with-the-beatles-4fd2526f5344d.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"With
          The Beatles is the second studio album by the English rock group The Beatles.
          It was released on 22 November 1963 on Parlophone, and was recorded four months
          after the band''s debut Please Please Me. The album features eight original
          compositions (seven by Lennon-McCartney and \"Don''t Bother Me\", George Harrison''s
          first recorded solo composition and his first released on a Beatles album)
          and six covers (mostly of Motown and R&B hits). Most of the songs from the
          album were released in the United States by Capitol Records as the Meet The
          Beatles! LP on 20 January 1964, and the remaining that were not, featured
          on their next US album, The Beatles'' Second Album.\n\nThe album was also
          released in November 1963 by Capitol Records in Canada, with a slight change
          to the title: Beatlemania! With The Beatles. This release has the distinction
          of being the first LP of Beatles material released in North America, pre-dating
          the Capitol US Meet The Beatles! and the Vee Jay Records Introducing... The
          Beatles LPs by two months.\n\nThe LP had advance orders of a half million
          and sold another half million by September 1965, making it the second album
          to sell a million copies in the United Kingdom, after the soundtrack to the
          1958 film South Pacific. With The Beatles stayed at the top of the charts
          for 21 weeks, displacing Please Please Me, so that The Beatles occupied the
          top spot for 51 consecutive weeks. It even reached number 11 in the \"singles
          charts\" (because at the time UK charts counted all records sold, regardless
          of format). EMI Australia did not receive the cover art, and used a caricature
          of the band in a similar style to the black-and-white photograph on other
          releases. The Beatles were unaware of this until fans showed them the cover
          during their only Australian tour, and informed the EMI publicity staff that
          they were not pleased with the substitution.\n\nOn 26 February 1987, With
          The Beatles was officially released on compact disc (in mono only, catalogue
          number CDP 7 46436 2). Having been available only as an import in the US in
          the past, the album was also issued domestically in the US on LP and cassette
          on 21 July 1987. Along with the rest of the Beatles'' canon, it was re-released
          on CD in newly re-mastered stereo and mono versions on 9 September 2009.\n\nIn
          2003, the album was ranked number 420 on Rolling Stone magazine''s list of
          the 500 greatest albums of all time.","strDescriptionDE":null,"strDescriptionFR":"With
          The Beatles est le deuxi\u00e8me album des Beatles, paru le 22 novembre 1963
          en Grande-Bretagne. Il est enregistr\u00e9 dans la foul\u00e9e de la sortie
          du single She Loves You, qui bat des records de vente alors que la Beatlemania
          bat son plein. Au milieu des tourn\u00e9es en Europe, le groupe enregistre
          en sept journ\u00e9es de travail, \u00e9tal\u00e9es sur trois mois, quatorze
          chansons compos\u00e9es en grande partie par le duo Lennon/McCartney.\n\nEnregistr\u00e9
          quatre mois apr\u00e8s leur premier album, Please Please Me, l''album contient
          huit chansons originales (incluant la toute premi\u00e8re composition de George
          Harrison) et six reprises, la plupart de succ\u00e8s de rhythm and blues de
          la Motown. Plus que pour leur album pr\u00e9c\u00e9dent, les Beatles ont recours
          \u00e0 de nouveaux instruments et techniques de studio, notamment pour doubler
          leur voix. L''album, qui est g\u00e9n\u00e9ralement moins connu que son pr\u00e9d\u00e9cesseur,
          est cependant jug\u00e9 plus m\u00fbr.\n\nCe deuxi\u00e8me opus conna\u00eet
          un \u00e9norme battage m\u00e9diatique, battant les records de pr\u00e9-commande,
          et d\u00e9tr\u00f4ne Please Please Me pour si\u00e9ger 21 semaines en t\u00eate
          des classements britanniques. Outre ses records de vente, il s''agit du premier
          disque des Beatles \u00e0 faire l''objet de critiques dans un journal s\u00e9rieux,
          le Times. La majorit\u00e9 des chansons de l''album sont r\u00e9utilis\u00e9es
          sur l''album am\u00e9ricain Meet The Beatles!, sorti le 20 janvier 1964.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"With
          the Beatles fue el segundo \u00e1lbum de estudio brit\u00e1nico de los Beatles,
          grabado cuatro meses despu\u00e9s de publicarse Please Please Me, y editado
          el 22 de noviembre de 1963 en mono (PMC 1206) y en est\u00e9reo (PCS 3045)
          en el sello discogr\u00e1fico Parlophone. Presentaba ocho composiciones originales
          \u2014incluyendo la primera de George Harrison\u2014 y seis versiones, la
          mayor\u00eda de la Motown y el R&B.\n\nEl LP tuvo un pre-pedido de medio mill\u00f3n
          de copias y vendi\u00f3 otro medio mill\u00f3n para septiembre de 1965, y
          se convirti\u00f3 en el segundo \u00e1lbum que vend\u00eda un mill\u00f3n
          de copias en el Reino Unido, pues el primero en conseguirlo fue la banda sonora
          original de la pel\u00edcula South Pacific (1958). Se mantuvo en la cima de
          la lista durante veinti\u00fan semanas, y desplaz\u00f3 a Please Please Me,
          de manera que los Beatles ocuparon el primer puesto durante cincuenta y un
          semanas consecutivas entre los dos \u00e1lbumes. Incluso lleg\u00f3 a alcanzar
          el n\u00famero once en la lista de sencillos \u2014en aquella \u00e9poca,
          las listas del Reino Unido contaba todas las grabaciones vendidas, independientemente
          del formato que tuvieran\u2014.\n\nEn el a\u00f1o 2012, la revista Rolling
          Stone clasific\u00f3 a With the Beatles en el puesto 419 en su lista de los
          500 mejores \u00e1lbumes de todos los tiempos.","strDescriptionPT":"With the
          Beatles \u00e9 o segundo \u00e1lbum do grupo de rock ingl\u00eas The Beatles,
          lan\u00e7ado em 22 de novembro de 1963, no mesmo dia em que o presidente dos
          Estados Unidos John F. Kennedy era assassinado em Dallas, Texas.\n\nGravado
          quatro meses ap\u00f3s ser lan\u00e7ado o primeiro \u00e1lbum, repetia a f\u00f3rmula
          de Please Please Me. Selecionaram-se 7 composi\u00e7\u00f5es pr\u00f3prias
          de Lennon/McCartney e incluiu-se novamente 6 covers das prediletas do repert\u00f3rio
          dos Beatles. George Harrison comparece com uma composi\u00e7\u00e3o pr\u00f3pria
          \"Don''t Bother Me\" neste trabalho cujo carro-chefe firmou-se at\u00e9 hoje
          com a m\u00fasica \"All My Loving\".","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"7","intScoreVotes":"2","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"a63dc65f-09f2-359b-a10e-648f00ecd96c","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"mw0000192941","strBBCReviewID":null,"strRateYourMusicID":"with_the_beatles","strDiscogsID":"45729","strWikidataID":"Q2614526","strWikipediaID":"With_the_Beatles","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2117305","idArtist":"111247","idLabel":"43827","strAlbum":"Rubber
          Soul","strAlbumStripped":"Rubber Soul","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1965","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/rubber-soul-4ddaafee1c33b.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/rubber-soul-4fd274577fc54.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Rubber
          Soul is the sixth studio album by the English rock group The Beatles, released
          in December 1965. Produced by George Martin, Rubber Soul was recorded in just
          over four weeks to make the Christmas market. Unlike the five albums that
          preceded it, Rubber Soul was recorded during a specific period, the sessions
          not dashed off in between either tour dates or during filming projects. After
          this, every Beatles album would be made without the need to pay attention
          to other commitments, except for the production of short promotional films
          or principal photography and editing to Magical Mystery Tour. The album was
          described as a major artistic achievement, attaining widespread critical and
          commercial success, with reviewers taking note of The Beatles'' developing
          musical vision.\n\nRubber Soul was successful commercially and critically,
          and is often cited as one of the greatest albums in music history. In 2012,
          Rubber Soul was voted 5th on Rolling Stone magazine''s list of the \"500 Greatest
          Albums of All Time\".","strDescriptionDE":null,"strDescriptionFR":"Rubber
          Soul est le sixi\u00e8me album des Beatles, paru le 3 d\u00e9cembre 1965 en
          Grande-Bretagne. Il est enregistr\u00e9 peu de temps apr\u00e8s la sortie
          de Help!, en seulement cinq semaines d''octobre et novembre 1965, afin d\u2019\u00eatre
          disponible pour les f\u00eates de No\u00ebl. Les Beatles r\u00e9ussissent
          malgr\u00e9 les contraintes \u00e0 fournir quatorze chansons originales.\n\nCe
          deuxi\u00e8me opus de l''ann\u00e9e 1965 est un album-charni\u00e8re dans
          la carri\u00e8re des Beatles. Toutes les chansons sont des compositions originales,
          comme sur A Hard Day''s Night, \u00e9crites par les membres du groupe ; il
          en est ainsi pour tous les albums suivants. Les Fab Four sortent de leur p\u00e9riode
          \u00ab bons gar\u00e7ons souriants et gais \u00bb, et \u00e9crivent des textes
          beaucoup plus m\u00fbrs qu''auparavant. Le groupe s''inspire par ailleurs
          de Bob Dylan pour les paroles. John Lennon et Paul McCartney y traitent, entre
          autres, des relations amoureuses complexes. L''instrumentation s''\u00e9largit,
          notamment avec l''introduction du sitar, et surtout la trame habituelle de
          leurs chansons (A-B-pont musical-reprise de B) fait place \u00e0 des alternances
          plus \u00e9labor\u00e9es.\n\n\u00c0 sa sortie, Rubber Soul est acclam\u00e9
          par la critique et conna\u00eet, comme ses pr\u00e9d\u00e9cesseurs, un \u00e9norme
          succ\u00e8s commercial. Au Royaume-Uni, il entre directement \u00e0 la premi\u00e8re
          place des hit-parades et y reste huit semaines. Il para\u00eet aux \u00c9tats-Unis
          le 6 d\u00e9cembre 1965, sous une forme \u00e9lagu\u00e9e et d\u00e9natur\u00e9e,
          et reste 59 semaines dans le hit-parade am\u00e9ricain. Il occupe la premi\u00e8re
          place pendant six semaines en janvier et f\u00e9vrier 1966. On d\u00e9nombre
          1 200 000 copies vendues en neuf jours, et quatre millions jusqu''\u00e0 aujourd''hui,
          seulement en Am\u00e9rique.\n\nSubtile coquetterie : s\u00fbr maintenant de
          sa notori\u00e9t\u00e9 universelle, le groupe ne juge pas m\u00eame utile
          de faire figurer son nom au recto de la pochette !","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Rubber
          Soul es el sexto \u00e1lbum de estudio de la banda brit\u00e1nica The Beatles,
          lanzado el 3 de diciembre de 1965. Producido por George Martin, fue grabado
          en s\u00f3lo cuatro semanas para as\u00ed poder aprovechar el mercado navide\u00f1o.
          A diferencia de sus cinco \u00e1lbumes anteriores, Rubber Soul fue el primero
          en ser grabado por sus autores durante un periodo espec\u00edfico concreto,
          sin ser interrumpido por giras musicales o proyectos f\u00edlmicos entre las
          sesiones de grabaci\u00f3n del \u00e1lbum. El \u00e1lbum fue descrito como
          un logro art\u00edstico importante de la banda, teniendo un amplio \u00e9xito
          comercial y de cr\u00edtica, y haciendo que los encargados de la rese\u00f1a
          tomasen nota de la visi\u00f3n musical que The Beatles iban desarrollando.\n\nLa
          edici\u00f3n original brit\u00e1nica reflejaba la influencia del \u00absoul\u00bb
          que mostraba el t\u00edtulo de la portada del \u00e1lbum. El listado de canciones
          cambiaba en la edici\u00f3n estadounidense, que inclu\u00eda dos canciones
          ac\u00fasticas provenientes del disco anterior brit\u00e1nico Help!, dando
          a la versi\u00f3n americana una impronta de folk rock que los cr\u00edticos
          atribu\u00edan a The Byrds y Bob Dylan.\n\nRubber Soul es a menudo citado
          como uno de los mejores \u00e1lbumes en la historia de la m\u00fasica popular.
          En 2001, la cadena de m\u00fasica por cable VH1 lo coloc\u00f3 en el n\u00famero
          6 de entre los mejores cien de la historia. En noviembre de 2003, la revista
          Rolling Stone lo coloc\u00f3 en el puesto 5 de su lista de los 500 mejores
          \u00e1lbumes de todos los tiempos. A excepci\u00f3n del \u00e1lbum brit\u00e1nico
          A Hard Day''s Night (todas las canciones atribuidas a Lennon\u2014McCartney),
          \u00e9ste es el primer \u00e1lbum de The Beatles (tanto en el Reino Unido
          como en los Estados Unidos) en que solo conten\u00eda temas compuestos por
          la banda.","strDescriptionPT":"Rubber Soul \u00e9 o sexto \u00e1lbum lan\u00e7ado
          pelo grupo de rock The Beatles. Foi gravado aproximadamente em quatro meses
          e lan\u00e7ado em 1965 sendo produzido por George Martin. \u00c9 citado por
          muitos cr\u00edticos de m\u00fasica como o \u00e1lbum em que os Beatles come\u00e7aram
          a tornar seu som mais ecl\u00e9tico e sofisticado. Este \u00e1lbum est\u00e1
          na lista dos 200 \u00e1lbuns definitivos no Rock and Roll Hall of Fame.\n\nNaquela
          altura, depois de amenizada a for\u00e7a primitiva do Rock, com a explos\u00e3o
          do folk-rock e da surf music, cada grupo passou a utilizar-se de todas as
          potencialidades que os est\u00fadios de grava\u00e7\u00e3o podiam oferecer.
          Os pr\u00f3prios Beatles superaram sua fase adolescente, passando pelas brincadeiras
          colocadas em filmes por Richard Lester, at\u00e9 o profundo universo po\u00e9tico
          que come\u00e7aram a desenvolver com o \u00e1lbum Rubber Soul. Realizaram
          ent\u00e3o verdadeiras \"rupturas\", como a letra surrealista e o uso do sitar
          em \"Norwegian Wood\", o lirismo de \"In My Life\" e \"Michelle\", a solid\u00e3o
          pungente de \"Nowhere Man\", enfim, Rubber Soul foi considerado o mais inovador
          \u00e1lbum de rock lan\u00e7ado at\u00e9 ent\u00e3o.","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"9.7","intScoreVotes":"3","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"dca03435-8adb-30a5-ba82-5a162267ff38","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"rubber-soul-mw000019","strBBCReviewID":"5gn8","strRateYourMusicID":"rubber_soul_f1","strDiscogsID":"45526","strWikidataID":"Q190640","strWikipediaID":"Rubber_Soul","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2118146","idArtist":"111247","idLabel":"43827","strAlbum":"Yellow
