          como un disco de gram\u00f3fono antes de que la industria discogr\u00e1fica
          lo dejara de fabricar en grandes cantidades a favor del formato disco compacto.\n\nAmbos
          vol\u00famenes de Past Masters fueron lanzados en un juego de dos CD, como
          parte del cat\u00e1logo remasterizado de The Beatles el 9 de septiembre de
          2009, con dos canciones anteriormente publicadas \u00fanicamente en mono se
          compilaron en est\u00e9reo: \"From Me to You\" y \"Thank You Girl\". Tambi\u00e9n
          se incluy\u00f3 en The Beatles Stereo Box Set.\n","strDescriptionPT":"Past
          Masters, Volume Two \u00e9 um \u00e1lbum de compila\u00e7\u00e3o dos The Beatles
          lan\u00e7ado em 1988. Cont\u00e9m faixas de v\u00e1rios singles da banda e
          uma vers\u00e3o diferente de \"Across the Universe\", lan\u00e7ada em um single
          beneficente.","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":null,"intScoreVotes":null,"strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"73c61a5d-9623-3d00-afbf-b3c6dc5e8b92","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":null,"strWikidataID":null,"strWikipediaID":null,"strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2141420","idArtist":"111247","idLabel":"43827","strAlbum":"1","strAlbumStripped":"1","strArtist":"The
          Beatles","strArtistStripped":"The Beatles","intYearReleased":"2000","strStyle":"Rock/Pop","strGenre":"Rock
          & Roll","strLabel":"EMI","strReleaseFormat":"Compilation","intSales":"31000000","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/1-4ff308fbe408d.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/1-4f2d2e9f58fe0.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"1
          is a compilation album by the Beatles, released on 13 November 2000. The album
          features virtually every number-one single released in the United Kingdom
          and United States from 1962 to 1970 by the Beatles. Issued on the 30th anniversary
          of the band''s break-up, it was their first compilation available on one compact
          disc. 1 was a commercial success, and topped the charts worldwide. The world''s
          best-selling album of the 21st century, 1 has sold over 31 million copies.\nIn
          addition, 1 is the seventh best-selling album since early 1991, the best-selling
          album in the US from 2000 to 2009, and the best selling album of the decade
          worldwide. It is also the fastest selling album in history. 1 was re-released
          in digitally remastered format in September 2011. Compiled by producer George
          Martin and the (then) three surviving members of the band, 1 includes the
          27 Beatles songs that went to number one in the United Kingdom on the Record
          Retailer magazine charts and/or the United States on the Billboard magazine
          charts. It is worth noting, however, that the song \"For You Blue\" was listed
          in Billboard chart compilations at No. 1, as a double A-sided single with
          \"The Long and Winding Road\", but Capitol Records treated \"For You Blue\"
          as strictly a B-side and did not promote it as an A-side. Meanwhile, \"Day
          Tripper\" was included on 1, since it charted at No. 1 in the UK as a double
          A side with \"We Can Work It Out\", while in the US, only \"We Can Work It
          Out\" was No. 1. The only singles released in both the UK and US that did
          not reach No. 1 in either country, and were therefore ineligible for inclusion
          on the album, were \"Please Please Me\" and \"Strawberry Fields Forever\"\u2014both
          reached No. 2 in the UK charts. The former was largely known as \"The Beatles''
          first UK number one single\"; however, it reached the top spot in the musical
          magazines New Musical Express and Melody Maker but not on the chart published
          by Record Retailer (now Music Week). On the other hand, \"Strawberry Fields
          Forever\" was part of a double A-side single along with \"Penny Lane\". Being
          a double A-side, UK sales policies counted the sales as a half of the real
          amount sold, a fact that kept the single at No. 2 in the charts, behind Engelbert
          Humperdinck''s debut single \"Release Me\".\nThis album is essentially a combination
          of both the US and UK versions of the earlier album 20 Greatest Hits, with
          \"Something\" added to the mix (that song was left off 20 Greatest Hits because
          of time constraints). On 1, \"Hey Jude\" was released in its original full-length
          version (slightly over seven minutes); on the American version of 20 Greatest
          Hits it had been released as a shortened version.","strDescriptionDE":null,"strDescriptionFR":"1
          est une compilation des Beatles, parue le 13 novembre 2000 au Royaume-Uni
          et le jour suivant aux \u00c9tats-Unis. Il s''agit en fait d''un best of :
          cet album regroupe tous les titres des Beatles qui ont figur\u00e9 en t\u00eate
          des ventes. En date du 17 juin 2006, cette compilation commercialis\u00e9e
          \u00e0 la fin de l\u2019ann\u00e9e 2000 se classe \u00e0 la 8e place du Top
          pop Catalogue Album du Billboard. Il s\u2019agit de sa 292e semaine de classement
          dans les charts.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"1
          (tambi\u00e9n conocido como The Beatles 1 o The Beatles One) es una recopilaci\u00f3n
          de 27 de los singles de The Beatles que alcanzaron la primera posici\u00f3n
          de las listas oficiales pop de Inglaterra y/o Estados Unidos. Con la asistencia
          del legendario productor George Martin, fue publicado el 13 de noviembre de
          2000.Fue el \u00e1lbum m\u00e1s vendido de la d\u00e9cada 2000-2009. Es uno
          de los seis \u00e1lbumes certificados con disco de diamante de The Beatles,
          lo que los convierte en los m\u00e1ximos ganadores de este reconocimiento
          en la historia de la m\u00fasica. Los otros \u00e1lbumes con disco de diamante
          son The Beatles/1962-1966, The Beatles, Abbey Road, Sgt. Pepper''s Lonely
          Hearts Club Band y The Beatles/1967-1970.","strDescriptionPT":"1 (tamb\u00e9m
          conhecido como The Beatles 1 ou The Beatles One) \u00e9 uma colet\u00e2nea
          de The Beatles, lan\u00e7ada em 13 de Novembro de 2000, dos 27 singles que
          alcan\u00e7aram a primeira posi\u00e7\u00e3o das listas oficiais do Reino
          Unido e/ou Estados Unidos.\n\nComercialmente, o \u00e1lbum excedeu todas as
          expectativas. Estreou no topo da maioria das listas de vendas do mundo (incluindo
          os Estados Unidos e Inglaterra). Gra\u00e7as a 1, os Beatles j\u00e1 colheram
          uma s\u00e9rie de novos recordes: o \u00e1lbum mais vendido da d\u00e9cada,
          o artista que mais vendeu em 2001 e o \u00e1lbum mais rapidamente vendido
          da hist\u00f3ria, com mais 10 milh\u00f5es de c\u00f3pias no primeiro m\u00eas.
          Estas s\u00e3o verdadeiras conquistas considerando-se que o grupo se separou
          tr\u00eas d\u00e9cadas atr\u00e1s.\n\nOs cr\u00edticos musicais e os seguidores
          da banda brit\u00e2nica reagiram positivamente. Alguns lamentaram a falta
          do cl\u00e1ssico single Strawberry Fields Forever, considerado um dos picos
          criativos do grupo. O mesmo com o segundo single dos Beatles, Please Please
          Me, que \u00e9 popularmente reconhecida como \"seu primeiro n\u00famero um\",
          mas, na verdade, s\u00f3 chegou ao topo em tr\u00eas listas brit\u00e2nicas
          de sucesso, mas nunca na lista de Record Retailer, que \u00e9 considerada
          \"oficial\". De qualquer maneira, ele continua a ser visto como uma excelente
          retrospectiva da carreira do grupo, incluindo todos os n\u00fameros um de
          cada grupo (exceto a pouco reconhecida For You Blue, composta por George Harrison,
          e que foi o \u00faltimo n\u00famero 1 da banda em 1970 nos Estados Unidos,
          ao lado do duplo lado A com The Long and Winding Road, can\u00e7\u00e3o que
          est\u00e1 em 1).","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"8.3","intScoreVotes":"3","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"Medium","strLocation":null,"strMusicBrainzID":"4f539c70-1a19-37a3-ba14-979f11fc0686","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":null,"strWikidataID":null,"strWikipediaID":null,"strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2146018","idArtist":"111247","idLabel":"43827","strAlbum":"Yellow
          Submarine Songtrack","strAlbumStripped":"Yellow Submarine Songtrack","strArtist":"The
          Beatles","strArtistStripped":"The Beatles","intYearReleased":"1999","strStyle":"Rock/Pop","strGenre":"Rock
          & Roll","strLabel":"EMI","strReleaseFormat":"Soundtrack","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/swqurw1376080074.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":null,"strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Yellow
          Submarine Songtrack is a compilation/soundtrack album by the Beatles for the
          1999 re-release of the 1968 film Yellow Submarine. The film was re-released
          on 13 September 1999 in the United Kingdom and the following day in the United
          States.\nIn sharp contrast with other Beatles remasters available (2009 box
          sets), the songs were fully remixed from the original multitrack tapes, something
          not done for the original Compact Disc release of the Beatles catalogue in
          the late 1980s except for Help! and Rubber Soul, not even in 2009.\nThis album
          contains only the Beatles songs used in the film, including tracks absent
          from the original Yellow Submarine album. The extra tracks replaced the George
          Martin film score from the original release, while the complete score was
          included as a DVD audio track in the CD/DVD package featuring the album and
          film.\nThe album debuted in the UK charts at No. 8 selling 19,000 copies in
          its first week. It also peaked at No. 15 on the Billboard 200, with 68,000
          copies sold in its opening week. In France the album debuted at No. 13.\nThe
          album was reissued on CD on 4 June 2012 (5 June in North America) along with
          the film restored for DVD and Blu-ray release. While the original 1999 release
          was in a jewel-case, the 2012 version was released in a digipak, with the
          booklet and catalogue numbers the same as the earlier version, with a 1999
          copyright date on the disc, and a 2012 date on the digipak.","strDescriptionDE":null,"strDescriptionFR":"Yellow
          Submarine Songtrack est un album du groupe britannique The Beatles, publi\u00e9
          en 1999 comme bande-originale pour la ressortie du film Yellow Submarine,
          originellement sorti en 1968. Il ne faut pas le confondre avec l''album Yellow
          Submarine de 1969, dont il reprend les six titres des Beatles mais auquel
          on ampute les th\u00e8mes instrumentaux de George Martin qui constituaient
          sa face B. On y ajoute en revanche tous les morceaux du film qui figuraient
          sur d''autres albums.\n\nL''originalit\u00e9 de la compilation r\u00e9side
          dans le fait que tous les morceaux sont pr\u00e9sent\u00e9s dans de nouveaux
          mixages audio r\u00e9alis\u00e9s par George Martin, l\u00e9g\u00e8rement diff\u00e9rents
          de ceux que l''on peut trouver sur les albums originaux.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Yellow
          Submarine Songtrack es un \u00e1lbum recopilatorio de The Beatles publicado
          en 1999, y que contiene canciones que aparecen en la pel\u00edcula animada
          de 1968 Yellow Submarine. Contiene sencillos (algunos con sus caras B). Todas
          las canciones fueron publicadas en el CD Yellow Submarine.\n\nEste \u00e1lbum
          es descripto como el m\u00e1s d\u00e9bil de todas las recopilaciones de The
          Beatles hasta el momento, vendiendo muy poco en los principales pa\u00edses,
          porque los discos de Los Beatles suelen escalar hasta el primer lugar en ventas,
          pero en este lo m\u00e1ximo que lo logro fue un 8\u00ba puesto en su pa\u00eds
          natal Inglaterra.\n\nEl CD debut\u00f3 en el Reino Unido en el #8 vendiendo
          19.000 copias en la primera semana y en los Estados Unidos #15 vendiendo 68.900
          en su primera semana en Francia en el puesto#13 y en Argentina #9 vendiendo
          4.680 copias la primera semana.\n\nLo interesante de estos temas es que son
          un Remix de los multitrack originales. Esta edici\u00f3n pone las voces en
          el centro y los instrumentos rode\u00e1ndolas, dando una sensaci\u00f3n nueva,
          en esta ocasi\u00f3n se ha hecho una adecuada mezcla en est\u00e9reo, el sonido
          de estos temas es incre\u00edble, ya que en el momento de hacer las mezclas
          originales no se hab\u00eda desarrollado adecuadamente esta t\u00e9cnica,
          pues el est\u00e1ndar de audio era monoaural. Una de las canciones m\u00e1s
          interesantes es Hey Bulldog, ya que la voz de Lennon se escucha con eco.","strDescriptionPT":"Yellow
          Submarine Songtrack \u00e9 uma colet\u00e2nea do grupo de rock ingl\u00eas
          The Beatles feita em 1999, ela cont\u00e9m m\u00fasicas gravadas entre 1965
          e 1968, o produtor do \u00e1lbum \u00e9 George Martin, o \u00e1lbum tem ao
          todo 45 minutos e 38 segundos, e as gravadoras dessa colet\u00e2nea foram
          a Apple Inc., EMI e a Capitol.","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":null,"intScoreVotes":null,"strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"9430dcc6-2164-4bec-bc33-9948f30063f7","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":null,"strWikidataID":null,"strWikipediaID":null,"strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2146428","idArtist":"111247","idLabel":"43827","strAlbum":"Beatles
          for Sale","strAlbumStripped":"Beatles for Sale","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1964","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/beatles-for-sale-4ddaafee1ea4b.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/beatles-for-sale-50e79d1c21dfc.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Beatles
          for Sale is the fourth studio album by the English rock band the Beatles,
          released on 4 December 1964 and produced by George Martin for Parlophone.
          The album marked a minor turning point in the evolution of the Lennon\u2013McCartney
          partnership, John Lennon particularly now showing interest in composing songs
          of a more autobiographical nature. \"I''m a Loser\" shows Lennon for the first
          time coming under the influence of Bob Dylan, whom he met in New York while
          on tour, on 28 August 1964.\nBeatles for Sale did not produce a single for
          the UK \u2013 the non-album tracks \"I Feel Fine\" and \"She''s a Woman\"
          performed that role. Nevertheless, that coupling was followed up in the United
          States by \"Eight Days a Week\", which became their seventh number one in
          March 1965.\nThe album hit the UK number one spot and retained that position
          for 11 of the 46 weeks that it spent in the Top 20. Beatles for Sale did not
          surface as a regular album in the US until 1987. In its place was Beatles
          ''65 which featured eight songs from Beatles for Sale, plus the A and B-side
          of \"I Feel Fine\" and \"I''ll Be Back\" from the UK''s A Hard Day''s Night
          album. Beatles ''65 enjoyed a nine-week run at the top of the US charts beginning
          in January 1965.","strDescriptionDE":null,"strDescriptionFR":"Beatles for
          Sale est le quatri\u00e8me album des Beatles, paru le 4 d\u00e9cembre 1964
          au Royaume-Uni. Il est con\u00e7u alors que la Beatlemania bat son plein,
          dans la foul\u00e9e de la sortie de l''album A Hard Day''s Night. Selon la
          volont\u00e9 du manager Brian Epstein et du producteur George Martin, le groupe
          doit, \u00e0 cette \u00e9poque, respecter un rythme de deux albums par an,
          celui-ci devant para\u00eetre \u00e0 temps pour les f\u00eates de fin d''ann\u00e9e.
          Il est donc rapidement enregistr\u00e9 aux studios EMI, en sept journ\u00e9es
          de travail \u00e9parpill\u00e9es entre ao\u00fbt et octobre 1964.\n\nLes Beatles
          ont alors acquis une popularit\u00e9 plan\u00e9taire, ils sont harass\u00e9s
          par les tourn\u00e9es internationales, les concerts quasi quotidiens et la
          folie qui les entoure, ce qui se refl\u00e8te notamment dans la pochette et
          les th\u00e8mes sombres de leurs chansons.\n\nAlors que toutes les chansons
          de A Hard Day''s Night \u00e9taient sign\u00e9es Lennon/McCartney, Beatles
          for Sale est marqu\u00e9 par le retour des reprises de rock ''n'' roll. Press\u00e9s
          par le temps, litt\u00e9ralement pouss\u00e9s vers les studios, les Fab Four
          enregistrent ici ce qui constitue leur r\u00e9pertoire de sc\u00e8ne du moment,
          incluant six reprises et huit chansons originales, nouvellement compos\u00e9es
          ou plus anciennes. L''album innove cependant dans plusieurs sens, avec des
          chansons plus personnelles de la part de John Lennon, et le recours plus fr\u00e9quent
          \u00e0 des techniques de studio pour peaufiner les enregistrements.\n\nEn
          Grande-Bretagne, Beatles for Sale passe sept semaines en premi\u00e8re place
          des hit-parades, d\u00e9logeant A Hard Day''s Night du sommet, et reste quarante-six
          semaines en tout dans les classements. Il ne para\u00eet pas sous cette forme
          aux \u00c9tats-Unis : onze jours apr\u00e8s la version britannique, il est
          \u00e9dit\u00e9 par Capitol Records avec une pochette, une liste de chansons
          et un nom diff\u00e9rents, Beatles ''65. De plus, certains titres n''apparaissent
          que sur l''album suivant, Beatles VI. Ce qui n''emp\u00eachera pas les deux
          albums, sortis \u00e0 un mois d''intervalle, de rester \u00e0 la premi\u00e8re
          place du Billboard, pendant plusieurs semaines de suite.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Beatles
          for Sale fue el cuarto \u00e1lbum de estudio brit\u00e1nico grabado por The
          Beatles, publicado el 4 de diciembre de 1964 por la compa\u00f1\u00eda discogr\u00e1fica
          Parlophone, con el n\u00famero de cat\u00e1logo PMC 1240 (mono) y PCS 3062
          (est\u00e9reo).\n\nCon un pedido de m\u00e1s de 700 000 discos antes de su
          publicaci\u00f3n, se clasific\u00f3 enseguida en el n\u00famero uno de la
          lista brit\u00e1nica, y desbanc\u00f3 de la misma a su \u00e1lbum predecesor,
          A Hard Day''s Night. Estuvo en ese puesto durante siete semanas, aunque el
          27 de febrero de 1965, despu\u00e9s de haber bajado tres semanas antes de
          ese primer puesto, habr\u00eda de volver a \u00e9l durante una semana m\u00e1s.
          El 1 de mayo de 1965 aun volver\u00eda a subir otra vez a la cima de la lista,
          despu\u00e9s de faltar ocho semanas en ese primer puesto, esta vez para permanecer
          en esa posici\u00f3n durante tres semanas m\u00e1s, y sumo as\u00ed un total
          de once semanas en el primer puesto de la lista brit\u00e1nica, de las cuarenta
          y seis que pas\u00f3 en ella. Este \u00e1lbum marc\u00f3 un momento decisivo
          en la evoluci\u00f3n de Lennon y McCartney como letristas, particularmente
          en Lennon, que estaba cada vez m\u00e1s interesado en componer canciones de
          naturaleza autobiogr\u00e1fica.","strDescriptionPT":"Beatles for Sale \u00e9
          o quarto \u00e1lbum do The Beatles, lan\u00e7ado em dezembro de 1964.\n\nQuando
          do lan\u00e7amento de \"Beatles For Sale\", a beatlemania estava a todo vapor
          e o sucesso do filme/\u00e1lbum \"A Hard Day''s Night\" havia trazido o reconhecimento
          de p\u00fablico e cr\u00edtica. Neste disco os Beatles repetiram a f\u00f3rmula
          \"Covers\" (dentre os quais a releitura definitiva de \"Rock And Roll Music\"
          de Chuck Berry) e composi\u00e7\u00f5es pr\u00f3prias, onde destacam-se \"Eight
          Days A Week\" e \"No Reply\".","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":"7","intScoreVotes":"1","strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"f50a3b6f-27f0-3832-bd3f-3568dc557d95","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":"beatles-for-sale-mw0","strBBCReviewID":"c2rj","strRateYourMusicID":"beatles_for_sale","strDiscogsID":"45799","strWikidataID":"Q207336","strWikipediaID":"Beatles_for_Sale","strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2150534","idArtist":"111247","idLabel":"43827","strAlbum":"Past
          Masters","strAlbumStripped":"Past Masters","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"2009","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Compilation","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/wryuyx1364735398.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/past-masters-55b91e1d1dcb8.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Past
          Masters is a two-volume compilation album set by The Beatles which was released
          in 1988 as part of the issue of the band\u2019s entire back catalogue on CD.
          Compiled by the noted Beatles authority Mark Lewisohn, this collection of
          many of the band''s biggest hits as well as rarities includes every song released
          commercially by the band that was not available on The Beatles\u2019 twelve
          original UK albums or the Magical Mystery Tour LP.\nThe majority of the Past
          Masters set consists of A and B-sides from the band''s singles, including
          single versions of songs that appeared in a different form on the band''s
          albums. Also included are the full contents of the UK-only Long Tall Sally
          EP, two German language tracks, a song recorded for the American market and
          a track released on a charity compilation album.","strDescriptionDE":null,"strDescriptionFR":"Past
          Masters est une compilation en deux volumes du groupe britannique The Beatles,
          commercialis\u00e9e en 1988. Une r\u00e9\u00e9dition remast\u00e9ris\u00e9e
          et regroup\u00e9e en un CD double para\u00eet en septembre 2009. Le 13 novembre
          2012, une version 33 tours de cet album double est publi\u00e9e1.\n\nLes Past
          Masters r\u00e9unissent les chansons principalement publi\u00e9es sur des
          singles (format 45 tours). Cette publication compl\u00e8te la discographie
          des Beatles dans la mesure o\u00f9 la grande majorit\u00e9 de ces titres n''\u00e9taient
          pas pr\u00e9sents sur les treize albums officiels sortis durant leurs sept
          ann\u00e9es d''enregistrements. On y retrouve aussi quelques chansons parues
          sur leurs 33 tours mais \u00e9dit\u00e9es en single dans des versions diff\u00e9rentes.\n\nPlusieurs
          pi\u00e8ces de cette compilation se sont class\u00e9es N\u00b01 dans les hit-parades
          des deux c\u00f4t\u00e9s de l''Atlantique.\n\nDisque 1\nOriginalement publi\u00e9
          en CD en 1988 sous le titre Past Masters, Volume 1, le disque 1 contient des
          chansons publi\u00e9es par les Beatles entre 1962 et 1965 qui ne figuraient
          pas sur leurs albums officiels. Une exception \u00e9tant Love Me Do qui appara\u00eet
          ici sous sa version originale du single enregistr\u00e9 le 4 septembre 1962
          avec Ringo Starr \u00e0 la batterie. Sur la version de l''album, c''est Andy
          White qui, \u00e0 l''invitation de George Martin, s''occupe de la rythmique.\n\nLe
          disque contient :\n- Treize titres issus de leurs singles (faces A ou B) ;\n-
          Les quatre titres issus du maxi Long Tall Sally ;\n- La chanson Bad Boy publi\u00e9e
          sur l\u2019album am\u00e9ricain Beatles VI\n\nDisque 2\nMis \u00e0 part la
          chanson Across the Universe, le disque 2 (originalement intitul\u00e9 Past
          Masters, Volume 2) contient les titres sortis en 45 tours entre d\u00e9cembre
          1965 et mars 1970. Ces morceaux ne figuraient pas sur leurs albums officiels,
          \u00e0 l''exception des chansons Get Back, Let It Be, Across the Universe
          et Revolution. Ces deux premi\u00e8res pi\u00e8ces sont les versions produites
          par George Martin, diff\u00e9rentes de celles pr\u00e9sentes dans l''album
          Let It Be. La pi\u00e8ce Across the Universe apparaissait sur un 33 tours
          caritatif comprenant des enregistrements de diff\u00e9rents artistes britanniques
          pour le Fonds mondial pour la nature. Plus tard, une autre version remix\u00e9e
          par Phil Spector se retrouvera aussi sur Let It Be. Quant au titre Revolution,
          il s''agit ici de sa version \u00ab rock \u00bb, enregistr\u00e9e apr\u00e8s
          le Revolution 1 \u00ab blues \u00bb qui figure sur l''\u00ab album blanc \u00bb.\n\nAucun
          45 tours de l''ann\u00e9e 1967 (soit, chronologiquement, Penny Lane/Strawberry
          Fields Forever, All You Need Is Love/Baby You''re a Rich Man et Hello Goodbye/I
          Am the Walrus) n''est pr\u00e9sent sur le Past Masters. Ceci est d\u00fb \u00e0
          la disparit\u00e9 entre les versions anglaise et am\u00e9ricaine de l''album
          Magical Mystery Tour. La version publi\u00e9e en Grande-Bretagne est un double
          maxi contenant les six titres qui apparaissent dans le t\u00e9l\u00e9film.
          En Am\u00e9rique du Nord, par contre, sur la face B du 33 tours publi\u00e9
          par Capitol Records, on ajoute 5 chansons tir\u00e9es des singles mentionn\u00e9s
          plus haut. Rapidement, les ventes en Angleterre de la version import\u00e9e
          d\u2019outre mer d\u00e9passent celle du double maxi. Finalement, le 4 d\u00e9cembre
          1976, EMI publie \u00e0 son tour la version augment\u00e9e. Lors des r\u00e9\u00e9ditions
          en CD de 1987 et de 2009, c\u2019est cette version de l\u2019album qui figurera
          dans la collection officielle.\n\n\nLors de la r\u00e9\u00e9dition du catalogue
          complet des Beatles en 2009, une version mono de Past Masters a \u00e9t\u00e9
          publi\u00e9e sous le nom Mono Masters. On y retrouve sensiblement les m\u00eames
          chansons, \u00e0 part Old Brown Shoe, The Ballad of John and Yoko et Let It
          Be qui ont \u00e9t\u00e9 mix\u00e9es qu''en st\u00e9r\u00e9o. Par contre,
          on y a rajout\u00e9 les 4 titres in\u00e9dits du disque Yellow Submarine (Only
          a Northern Song, All Together Now, Hey Bulldog et It''s All Too Much) qui
          furent mix\u00e9es en mono \u00e0 l''\u00e9poque pour une \u00e9ventuelle
          sortie en maxi mais qui n''a jamais vu le jour.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Past
          Masters es un \u00e1lbum recopilatorio de dos tomos de The Beatles publicado
          en 1988 despu\u00e9s de la publicaci\u00f3n en 1987 de los \u00e1lbumes de
          estudio del Reino Unido en CD. Past Masters recoge las pistas que no fueron
          lanzadas en \u00e1lbumes de estudio, de modo que todo el cat\u00e1logo de
          la banda podr\u00eda estar disponible en CD. Past Masters contiene todas las
          canciones no incluidas en los 12 \u00e1lbumes originales de Reino Unido o
          el LP Magical Mystery Tour que fueron lanzados comercialmente por EMI desde
          1962 hasta 1970. La mayor parte del \u00e1lbum consiste en los lados A y B
          de los sencillos de la banda (incluidas las versiones individuales de canciones
          que aparecen diferente en los \u00e1lbumes), adem\u00e1s de todo el contenido
          \u00fanico del Reino Unido y el EP Long Tall Sally, dos grabaciones en lengua
          alemana, una canci\u00f3n grabada para el mercado estadounidense y una pista
          utilizada en una compilaci\u00f3n de caridad completan la colecci\u00f3n.\n\nPast
          Masters se public\u00f3 inicialmente en dos CD separados, el 7 de marzo de
          1988, con dos LP de vinilo combinados, el 24 de octubre de 1988 en los Estados
          Unidos y el 10 de noviembre de 1988 en el Reino Unido. Los CD originales fueron
          incluidos en The Beatles Box Set en 1988. Un juego de dos CD de ambos vol\u00famenes,
          con dos nuevas mezclas est\u00e9reo fue lanzado el 9 de septiembre de 2009
          como parte del proyecto de la versi\u00f3n remasterizada de The Beatles. Esta
          versi\u00f3n se incluy\u00f3 en The Beatles Stereo Box Set. En The Beatles
          in Mono, un \u00e1lbum titulado Mono Masters tom\u00f3 el lugar de Past Masters,
          que contiene una lista de pistas similares en las mezclas en mono originales.
          Las listas de canciones del segundo disco son diferentes, lo que refleja el
          hecho de que las canciones m\u00e1s tarde se mezclaron o se lanzaron \u00fanicamente
          en est\u00e9reo.\n\nEste fue el \u00faltimo \u00e1lbum de The Beatles lanzado
          como un disco de gram\u00f3fono antes de que la industria discogr\u00e1fica
          lo dejara de fabricar en grandes cantidades a favor del formato disco compacto.\n\nAmbos
          vol\u00famenes de Past Masters fueron lanzados en un juego de dos CD, como
          parte del cat\u00e1logo remasterizado de The Beatles el 9 de septiembre de
          2009, con dos canciones anteriormente publicadas \u00fanicamente en mono se
          compilaron en est\u00e9reo: \"From Me to You\" y \"Thank You Girl\". Tambi\u00e9n
          se incluy\u00f3 en The Beatles Stereo Box Set.\n","strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":null,"intScoreVotes":null,"strReview":"","strMood":"Happy","strTheme":"","strSpeed":"Fast","strLocation":null,"strMusicBrainzID":"37657513-7a52-42bd-b235-09347c437cb2","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":null,"strWikidataID":null,"strWikipediaID":null,"strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2173397","idArtist":"111247","idLabel":"43827","strAlbum":"Anthology
          1","strAlbumStripped":"Anthology 1","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1995","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Compilation","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/anthology-1-4fd2d04c071ab.JPG","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/anthology-1-4fd2d4cf30e6f.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Anthology
          1 is a compilation album by The Beatles, released by Apple Records in November
          1995. It was released as the first part of the Anthology trilogy of albums
          with Anthology 2 and Anthology 3, all of which tie-in with the televised special
          The Beatles Anthology. It contains \"Free as a Bird\", billed as the first
          new Beatles song in 25 years. The album topped the Billboard 200 album chart
          and was certified 8x Platinum by the RIAA. The Anthology albums were made
          available on the iTunes Store on 14 June 2011.","strDescriptionDE":null,"strDescriptionFR":"Anthology
          1 est le premier des trois volumes de la s\u00e9rie de compilations Anthology
          des Beatles, paru le 21 novembre 1995 des deux c\u00f4t\u00e9s de l\u2019Atlantique.
          Il se compose principalement d\u2019enregistrements rares et in\u00e9dits
          du groupe.\n\nLes titres qui se retrouvent sur cette compilation datent de
          1958 \u00e0 1964, depuis l\u2019\u00e9poque des Quarrymen jusqu\u2019\u00e0
          la pr\u00e9paration de l\u2019album Beatles for Sale fin 1964. Elle retrace
          en passant la fameuse audition rat\u00e9e chez Decca, et de nombreux extraits
          parl\u00e9s des membres du groupe et de leurs proches. Ce premier volume Anthology
          contient une \u00ab nouvelle \u00bb chanson : Free as a Bird. Cette chanson
          a \u00e9t\u00e9 retrouv\u00e9e sur des enregistrements effectu\u00e9s par
          John Lennon en 1977, non exploit\u00e9s, et que les Beatles survivants ont
          termin\u00e9 lors de leur r\u00e9union en 1994. Elle devint ainsi la premi\u00e8re
          nouveaut\u00e9 des Beatles \u00e0 para\u00eetre, 25 ans apr\u00e8s la s\u00e9paration
          du groupe. Une autre chanson est retravaill\u00e9e pour l\u2019album suivant
          : Real Love.\n\nLa compilation rencontre un important succ\u00e8s commercial,
          dont trois millions de copies sont vendues en seulement six semaines sur le
          march\u00e9 am\u00e9ricain, fait remarquable pour un groupe \u00e0 l\u2019\u00e9poque
          dissout depuis 25 ans.\n\nAnthology 1 pr\u00e9sente un int\u00e9r\u00eat historique
          pour les fans, du fait qu\u2019il contient, entre autres, les performances
          des ex-Beatles Pete Best \u2014 \u00e0 la batterie \u2014 et Stuart Sutcliffe
          \u2014 \u00e0 la basse. On peut entendre Sutcliffe sur trois pistes : Hallelujah,
          I Love Her So, You''ll Be Mine, et Cayenne, et Best \u2014 qui fut d\u00e9barqu\u00e9
          du groupe mi-ao\u00fbt 1962 peu apr\u00e8s la premi\u00e8re audition chez
          EMI \u2014 sur les pistes 10 \u00e0 12, 15 \u00e0 19, 21 et 22 du premier
          disque. C''est donc lui que l''on entend sur la version de Love Me Do pr\u00e9sente
          dans cette compilation.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Anthology
          1 es un \u00e1lbum recopilatorio del grupo de rock brit\u00e1nico The Beatles,
