          2 is a compilation album by The Beatles, released by Apple Records in March
          1996. It is the second of the three-volume Anthology collection, all of which
          tie-in with the televised special The Beatles Anthology. The opening track
          is \"Real Love\", the second of the two recordings that reunited the Beatles
          by means of magnetic tape. Like its predecessor, the album topped the Billboard
          200 album chart, and has been certified 4\u00d7 Platinum by the RIAA. The
          Anthology albums were made available on the iTunes Store on 14 June 2011.","strDescriptionDE":null,"strDescriptionFR":"Anthology
          2 est une compilation des Beatles sortie en mars 1996 dans le cadre de la
          collection The Beatles Anthology.\n\nCet album contient des enregistrements
          rares, parfois effectu\u00e9s en concerts, et des prises alternatives provenant
          de diverses sessions aux studios Abbey Road, depuis celles de l''album Help!
          au printemps 1965, jusqu''au titres enregistr\u00e9s d\u00e9but 1968 avant
          le d\u00e9part du groupe pour l''Inde. Il contient aussi la seconde \u00ab
          nouvelle chanson \u00bb des Beatles, Real Love, compos\u00e9e par John Lennon
          et r\u00e9arrang\u00e9e par le groupe.\n\n\u00c0 l''instar du pr\u00e9c\u00e9dent
          volume de la collection, Anthology 2 obtint un succ\u00e8s consid\u00e9rable
          au moment de sa sortie. Il a m\u00eame atteint la premi\u00e8re place des
          charts anglais durant une semaine.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Anthology
          2 es un \u00e1lbum recopilatorio del grupo de rock brit\u00e1nico The Beatles,
          publicado en 1996 como parte de la serie The Beatles Anthology.\n\nEl \u00e1lbum
          incluye rarezas, temas en directo y tomas alternativas registradas durante
          las sesiones de grabaci\u00f3n de Help! hasta poco antes del viaje del grupo
          a la India en febrero de 1968.\n\nEl \u00e1lbum incluye \u00abReal Love\u00bb,
          segundo nuevo trabajo del grupo sobre una demo grabada por John Lennon y dada
          a Paul McCartney por la viuda de aqu\u00e9l, Yoko Ono, para que el resto de
          la banda la terminase de grabar. A diferencia de \u00abFree as a Bird\u00bb,
          in\u00e9dita hasta 1995 con la excepci\u00f3n de entre determinados c\u00edrculos
          de coleccionistas, \u00abReal Love\u00bb hab\u00eda aparecido previamente
          en el documental Imagine: John Lennon y en su correspondiente banda sonora.","strDescriptionPT":"The
          Beatles Anthology 2 \u00e9 um CD duplo lan\u00e7ado em mar\u00e7o de 1996
          com grava\u00e7\u00f5es alternativas, algumas raras, outras como ensaios,
          outras n\u00e3o aproveitadas, executadas pelos integrantes dos Beatles, juntos
          ou individualmente. Cobre o per\u00edodo que vai de 1965 at\u00e9 1968. Coincide
          com o in\u00edcio das sess\u00f5es das grava\u00e7\u00f5es para o \u00e1lbum
          Help! e se estende at\u00e9 as m\u00fasicas gravadas nas felizes sess\u00f5es
          de fevereiro de 1968, antes de viagem para a \u00cdndia. Inclui tamb\u00e9m
          a can\u00e7\u00e3o \"Real Love\" gravada e produzida em 1995 a partir de uma
          fita demo de John Lennon, tal qual fizeram com \"Free as a Bird, lan\u00e7ada
          no CD anterior, Anthology 1\". Dura 127''54\" .","strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":null,"intScoreVotes":null,"strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"b6449c69-7d1c-3223-8f4c-6a6fff1fe092","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":null,"strWikidataID":null,"strWikipediaID":null,"strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2173399","idArtist":"111247","idLabel":"43827","strAlbum":"Anthology
          3","strAlbumStripped":"Anthology 3","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1996","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Compilation","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/anthology-3-4fd2d8077a957.JPG","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/anthology-3-4fd2d94bb33df.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Anthology
          3 is a compilation album by The Beatles released in October 1996 by Apple
          Records as part of The Beatles Anthology series. The album includes rarities
          and alternative tracks from the final two years of the band''s career, ranging
          from the initial sessions for The Beatles (also known as The White Album)
          to the last sessions for Let It Be and Abbey Road in later 1969 and early
          1970.\nFollowing \"Free as a Bird\" in Anthology 1 and \"Real Love\" in Anthology
          2, a third John Lennon solo demo entitled \"Now and Then\" was to be reworked
          by the three surviving members of The Beatles for Anthology 3. However, it
          was decided against due to complications and sound quality issues involving
          Lennon''s recording. In its place is \"A Beginning\", an orchestral instrumental
          track initially intended for The White Album. \"A Beginning\" was composed
          by producer George Martin and intended to be the intro track to the Ringo
          Starr penned \"Don''t Pass Me By\".\nSimilar to the previous Anthology albums,
          the cover image painted by Klaus Voorman features a collage of The Beatles-related
          imagery designed to appear as a wall of peeling posters and album covers.
          An updated picture of Voorman can be seen in George Harrison''s hair in a
          segment of the Revolver album cover.\nThe album was certified 3x Platinum
          by the RIAA, and was the group''s third double album in a row to reach #1
          on the US charts, equalling a record set by Donna Summer back in the 1970s.\nThe
          Anthology albums were made available on the iTunes Store on 14 June 2011.","strDescriptionDE":null,"strDescriptionFR":"Anthology
          3 est une compilation sortie en novembre 1996 dans le cadre de la collection
          The Beatles Anthology. Il contient des enregistrements rares et des versions
          alternatives des chansons des Beatles, depuis les sessions initiales de l\u2019Album
          Blanc, jusqu''aux derni\u00e8res de Abbey Road.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Anthology
          3 es un \u00e1lbum recopilatorio del grupo de rock brit\u00e1nico The Beatles,
          publicado en 1996 como parte de la serie The Beatles Anthology. El \u00e1lbum
          incluye rarezas, interpretaciones en directo y tomas alternativas desarrolladas
          en las sesiones de grabaci\u00f3n que van desde el \u00c1lbum Blanco hasta
          las \u00faltimas reuniones del grupo para los \u00e1lbumes Let It Be y Abbey
          Road.\n\nUna tercer demo de John Lennon, titulado \"Now and Then\", fue ampliado
          en el estudio por Paul McCartney, George Harrison y Ringo Starr en un intento
          por incluirla en Anthology 3, si bien ser\u00eda finalmente descartada debido
          a un ruido de fondo que no pod\u00eda ser eliminado con las t\u00e9cnicas
          de estudio. En su reemplazo, fue a\u00f1adida A Beginning compuesta por George
          Martin.","strDescriptionPT":"Anthology 3 \u00e9 um \u00e1lbum duplo lan\u00e7ado
