          ''65","strAlbumStripped":"Beatles 65","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"1964","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Album","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/wqqrwy1376082386.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/beatles-65-55bd55f9ec74a.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Beatles
          ''65 is the Beatles'' fifth Capitol release, but seventh American album. It
          was released in mono and stereo versions. The album was also issued in Germany
          on the Odeon label.\n\nOn 16 November 2004, this album was released on Compact
          Disc for the first time as part of The Capitol Albums, Volume 1 box set.\n\nIn
          the US the album was a blockbuster hit, and jumped from number 98 straight
          to number one, making the biggest jump to the top position in the history
          of the Billboard Album Charts up to that time. It remained at number one for
          nine straight weeks, starting on 9 January 1965. In what may be testament
          to the overwhelming market appeal of the Beatles, several albums were released
          and promoted in America during 1965 sporting a similar title. These included
          Sinatra ''65 by Frank Sinatra and Ellington ''65 by Duke Ellington on Reprise
          Records, Trio ''65 by jazz pianist Bill Evans on Verve Records, and Brasil
          ''65 by S\u00e9rgio Mendes on the Beatles'' own Capitol label.","strDescriptionDE":null,"strDescriptionFR":"Beatles
          ''65 est un album des Beatles, le 6e publi\u00e9 aux \u00c9tats-Unis par Capitol
          Records. Onze jours apr\u00e8s la sortie de Beatles For Sale sur le label
          Parlophone au Royaume-Uni, il en reprend neuf titres (sur 14), compl\u00e9t\u00e9s
          par I Feel Fine (publi\u00e9 en single de l''autre c\u00f4t\u00e9 de l''Atlantique),
          et I''ll Be Back, paru pr\u00e9c\u00e9demment sur l''\u00e9dition britannique
          de l''album A Hard Day''s Night.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"Beatles
          ''65 es un \u00e1lbum de estudio de la banda brit\u00e1nica The Beatles. Fue
          editado en especial para el mercado estadounidense en 1964. Era el quinto
          \u00e1lbum lanzado por Capitol Records, pero sexto contando con el primero
          lanzado por Vee-Jay Records.\n\nEl \u00e1lbum se convirti\u00f3 en un gran
          \u00e9xito en los Estados Unidos, saltando directamente del n.\u00ba 98 al
          n.\u00ba 1, haciendo el mayor salto a la posici\u00f3n de privilegio en la
