          del abrumador atractivo que supusieron los Beatles para el mercado estadounidense,
          varios \u00e1lbumes fueron publicados y promovidos en aquel pa\u00eds durante
          1965 luciendo un t\u00edtulo similar. Entre ellos estaban Sinatra ''65, de
