          & Roll","strLabel":"EMI","strReleaseFormat":"Compilation","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/19621966-4fd2f08a161a1.JPG","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/19621966-4fd2f03666ba5.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"1962\u20131966
          (widely known as \"The Red Album\") is a compilation of songs by the English
          rock band The Beatles, spanning the years indicated in the title. It was released
          with its counterpart 1967\u20131970 (\"The Blue Album\") in 1973. 1962\u20131966
          reached number 3 in the United Kingdom and managed to reach number 1 in the
          United States Cashbox albums chart. However, in the US, the official chart
          was administered by Billboard, where 1962\u20131966 peaked at number 3, while
          1967\u20131970 reached the top spot. This album was re-released in September
          1993 on compact disc, charting at number 3 in the UK.\n\nThe album was compiled
          by Beatles manager Allen Klein. Even though the group had had success with
          cover versions of songs, most notably with \"Twist and Shout\", which made
          number 2 on the Billboard charts, only songs composed by the Beatles themselves
          were included.\n\nAs with 1967\u20131970, this compilation was produced by
          Apple/EMI at least partially in response to a bootleg collection titled Alpha
          Omega, which had been sold on television the previous year. Print advertising
          for the two records made a point of declaring them \"the only authorized collection
          of the Beatles.","strDescriptionDE":null,"strDescriptionFR":"1962-1966 \u2014
          aussi connu sous le surnom The Red Album (l''album rouge) \u2014 est une compilation
          rassemblant 26 des plus grands succ\u00e8s des Beatles publi\u00e9s entre
          1962 et 1966. Originalement sorti en 1973, il est publi\u00e9 pour la premi\u00e8re
          fois sur CD le 20 septembre 1993 tandis qu''une version remast\u00e9ris\u00e9e
          est publi\u00e9e en 2010. L''album est un grand succ\u00e8s commercial.","strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":"The
          Beatles/1962-1966, conocido como Red Album (\u00c1lbum Rojo), es una compilaci\u00f3n
