          Saw Her Standing There","strAlbumStripped":"I Saw Her Standing There","strArtist":"The
          Beatles","strArtistStripped":"The Beatles","intYearReleased":"2013","strStyle":"Rock/Pop","strGenre":"Rock
          & Roll","strLabel":"EMI","strReleaseFormat":"Compilation","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/rryssv1506784037.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":null,"strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"I
          Saw Her Standing There is a compilation album by the English rock band The
          Beatles. It is a 2-CD collection of their early recordings, featuring songs
          from the band''s Decca Auditions and performances from the Cavern Club, as
          well as their first ever radio interview. 29 of the 49 of the songs on the
          album are previously unreleased on any official Beatles album.\n\nDisc 1 is
          mainly compiled from early performances by The Beat Brothers (an early incarnation
          of the Beatles) and feature rock and roll singer Tony Sheridan on vocals.
          Ringo Starr appears only on the last two tracks on disc 2. The album also
          includes the instrumental track \"Cry for a Shadow\", the only Beatles composition
          to be credited to \"Harrison/Lennon\".","strDescriptionDE":null,"strDescriptionFR":null,"strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":null,"strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":null,"intScoreVotes":null,"strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"ecbc8e9a-2797-4fc2-8134-923e0f2ccac3","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":null,"strWikidataID":null,"strWikipediaID":null,"strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2186624","idArtist":"111247","idLabel":"43827","strAlbum":"On
          Air - Live at the BBC, Volume 2","strAlbumStripped":"On Air  Live at the BBC
          Volume 2","strArtist":"The Beatles","strArtistStripped":"The Beatles","intYearReleased":"2013","strStyle":"Rock/Pop","strGenre":"Rock
          & Roll","strLabel":"EMI","strReleaseFormat":"Live","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/yvpuuy1506784313.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/on-air--live-at-the-bbc-volume-2-55b68983a4af8.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"On
          Air \u2013 Live at the BBC Volume 2 is a 2013 live/compilation album featuring
          63 previously unreleased tracks from the Beatles'' 1963\u20131964 BBC Radio
          broadcasts. It was released on 11 November 2013, along with a remastered and
          repackaged Live at the BBC Volume 1, which was originally released in 1994.
          The album is available as a two-CD set and a three-LP set. An exclusive limited
          edition lithographic print is also available from the Beatles online store.
          There are several witty and irreverent moments included within the 23 speech
          tracks. \"A Hard Job Writing Them\", for example, includes the moment where
          Ringo describes the trouble he had writing songs for A Hard Day''s Night and
          Paul launches the ship \"Top Gear\" in an unusual voice.","strDescriptionDE":null,"strDescriptionFR":null,"strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":null,"strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":null,"intScoreVotes":null,"strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"bb6df91e-0112-41b9-8c42-b380530bdf53","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":null,"strWikidataID":null,"strWikipediaID":null,"strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2186625","idArtist":"111247","idLabel":"43827","strAlbum":"Mono
          Masters","strAlbumStripped":"Mono Masters","strArtist":"The Beatles","strArtistStripped":"The
          Beatles","intYearReleased":"2009","strStyle":"Rock/Pop","strGenre":"Rock &
          Roll","strLabel":"EMI","strReleaseFormat":"Compilation","intSales":"0","strAlbumThumb":"https://www.theaudiodb.com/images/media/album/thumb/mono-masters-5486ee0c9c337.jpg","strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":"https://www.theaudiodb.com/images/media/album/cdart/mono-masters-55a9a9010612d.png","strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Mono
          Masters was included as part of The Beatles in Mono box set. The premise of
          this box set was to compile only Beatles material which was released or prepared
          for release with a dedicated mono mix (the set excludes later material mixed
          and released only in stereo, and material whose mono version was simply created
          as an equal mix of the two channels of the stereo version). As a result, the
          track listing for Mono Masters differs from Past Masters on the second half
          of disc two, omitting some later songs that never had a mono mix (\"Old Brown
          Shoe\", \"The Ballad of John and Yoko\" and \"Let It Be\"), and adding several
          songs released on stereo-only albums that had unreleased mono mixes. Tracks
          9\u201312 and 15 were prepared in March 1969 for release as a 7\" mono Yellow
          Submarine EP, but due to poor reception of the full album, the project was
          abandoned. Subsequently, the tracks were only released in stereo (and in an
          electronically-produced mono mixdown, or \"fold-down\", of the stereo mix),
          while the true mono mixes remained unreleased. \"Get Back\" (with B-side \"Don''t
          Let Me Down\") was the final Beatles single mixed for mono format. It was
          released in the UK in mono, though the US release was in stereo. Thus, the
          songs that were originally released on stereo singles in the UK are omitted
          on this release.","strDescriptionDE":null,"strDescriptionFR":null,"strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":null,"strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"intLoved":null,"intScore":null,"intScoreVotes":null,"strReview":"","strMood":"Happy","strTheme":null,"strSpeed":"","strLocation":null,"strMusicBrainzID":"091a0ffc-5175-44dd-8248-9c2f705c2ccb","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strAllMusicID":null,"strBBCReviewID":null,"strRateYourMusicID":null,"strDiscogsID":null,"strWikidataID":null,"strWikipediaID":null,"strGeniusID":null,"strLyricWikiID":null,"strMusicMozID":null,"strItunesID":null,"strAmazonID":null,"strLocked":"unlocked"},{"idAlbum":"2199865","idArtist":"111247","idLabel":"43827","strAlbum":"1962
          Live Recordings","strAlbumStripped":"1962 Live Recordings","strArtist":"The
          Beatles","strArtistStripped":"The Beatles","intYearReleased":"1988","strStyle":"Rock/Pop","strGenre":"Rock
          & Roll","strLabel":"EMI","strReleaseFormat":"Live","intSales":"0","strAlbumThumb":null,"strAlbumThumbHQ":null,"strAlbumThumbBack":null,"strAlbumCDart":null,"strAlbumSpine":null,"strAlbum3DCase":null,"strAlbum3DFlat":null,"strAlbum3DFace":null,"strAlbum3DThumb":null,"strDescriptionEN":"Live!
          at the Star-Club in Hamburg, Germany; 1962 is a double album featuring live
          performances by the English rock group The Beatles, recorded in late December
          1962 at the Star-Club during their final Hamburg residency. The album was
          released in 1977 in two different versions, comprising a total of 30 songs
          by The Beatles.\nThe performances were recorded on a home tape machine using
          a single microphone, resulting in a low fidelity recording. Ted \"Kingsize\"
          Taylor began to investigate possible marketing of the tapes in 1973. The tapes
          were eventually bought by Paul Murphy and subjected to extensive audio processing
          to improve the sound, leading to the 1977 album.\nAlthough the poor sound
          quality limits its commercial appeal, the album provides historic insight
          into the group''s club act in the period after Ringo Starr joined but before
          the emergence of Beatlemania. The Beatles were unsuccessful in legally blocking
          the initial release of the album; the recordings were reissued in many forms
