          '{"artists":[{"idArtist":"111247","strArtist":"The Beatles","strArtistStripped":null,"strArtistAlternate":"Beatles","strLabel":"EMI","idLabel":"43827","intFormedYear":"1957","intBornYear":null,"intDiedYear":"1970","strDisbanded":"Yes","strStyle":"Rock/Pop","strGenre":"Rock","strMood":"Happy","strWebsite":"thebeatles.com","strFacebook":"www.facebook.com/thebeatles","strTwitter":"twitter.com/thebeatles","strBiographyEN":"The
          Beatles were an English rock band formed in Liverpool in 1960, becoming one
          of the most commercially successful and critically acclaimed acts in the history
          of popular music. The group''s best-known lineup consisted of John Lennon
          (rhythm guitar/vocals), Paul McCartney (bass guitar/vocals), George Harrison
          (lead guitar/vocals), and Ringo Starr (drums/vocals). Rooted in skiffle and
          1950s rock and roll, the group later utilised many genres, ranging from pop
          ballads to psychedelic rock, often incorporating classical and other elements,
          in innovative ways. In the early 1960s, their enormous popularity first emerged
          as \"Beatlemania\", but as their songwriting grew in sophistication, they
          came to be perceived by many fans and cultural observers as an embodiment
          of the ideals shared by the era''s sociocultural revolutions.\nAs a five-piece
          line-up of Lennon, McCartney and Harrison on guitar and vocals, with Stuart
          Sutcliffe (bass), and Pete Best (drums), the band built their reputation playing
          clubs in Liverpool and Hamburg over a three-year period from 1960. Sutcliffe
          left the group in 1961, and Best was replaced by Starr the following year.
          They were moulded into a professional act by manager Brian Epstein, and their
          musical potential was enhanced by the creativity of producer George Martin.
          They gained popularity in the United Kingdom after their first single, \"Love
          Me Do\", became a modest hit in late 1962. They acquired the nickname the
          \"Fab Four\" as Beatlemania grew in Britain over the following year, and by
          early 1964 they had become international stars, leading the \"British Invasion\"
          of the United States pop market. The band toured extensively around the world
          until August 1966, when they performed their final commercial concert. From
          1966 they produced what many critics consider to be some of their finest material,
          including the innovative and widely influential albums Revolver (1966), Sgt.
          Pepper''s Lonely Hearts Club Band (1967), The Beatles (1968), and Abbey Road
          (1969). After their break-up in 1970, the ex-Beatles each found success in
          individual musical careers. Lennon was murdered in 1980, and Harrison died
          of cancer in 2001. McCartney and Starr remain active.\nThe Beatles are the
          best-selling band in history, with sales of over one billion units estimated
          by EMI Records. They have had more number-one albums on the British charts
          and sold more singles in the UK than any other act. According to the RIAA,
          as of 2012 they have sold 177 million units in the US, more than any other
          artist, and in 2008 they topped Billboard magazine''s list of the all-time
          most successful Hot 100 artists. As of 2012, they hold the record for most
          number-one hits on the Hot 100 chart with 20. They have received 7 Grammy
          Awards from the American National Academy of Recording Arts and Sciences,
          an Academy Award for Best Original Song Score and 15 Ivor Novello Awards from
          the British Academy of Songwriters, Composers and Authors. They were collectively
          included in Time magazine''s compilation of the 20th century''s 100 most influential
          people.","strBiographyDE":"The Beatles waren eine britische Rockband in den
          1960er Jahren. Mit mehr als 600 Millionen \u2013 nach Sch\u00e4tzungen ihrer
          Plattenfirma EMI sogar mehr als einer Milliarde \u2013 verkauften Tontr\u00e4gern
          geh\u00f6ren sie zu den kommerziell erfolgreichsten Bands der Musikgeschichte.\nDie
          musikalischen Urspr\u00fcnge der Band liegen im Rock \u2019n\u2019 Roll der
          ausgehenden 1950er Jahre, in den dann sehr bald Stilelemente der Liverpooler
          Beatmusik einflossen. Ihre erste Single Love Me Do erschien 1962. Den weltweiten
          Durchbruch schaffte die Gruppe im Jahr 1963 mit der Single I Want to Hold
          Your Hand. Aufgrund ihres damals neuartigen Musikstils und ihrem \u00f6ffentlichen
          Auftreten entwickelten sich die Beatles schnell zu einer der popul\u00e4rsten
          Bands. Den H\u00f6hepunkt ihrer Karriere erreichten die Beatles zwischen 1964
          und 1968, als sie zeitweise in fast allen L\u00e4ndern die Hitparaden anf\u00fchrten.\nIm
          Jahr 1970 trennten sich die Wege der vier Bandmitglieder aufgrund interner
          Spannungen. Die Musiker verfolgten danach eigene erfolgreiche Musikprojekte.","strBiographyFR":"The
          Beatles est un groupe musical originaire de Liverpool, compos\u00e9 de John
          Lennon, Paul McCartney, George Harrison et Ringo Starr. \nIl demeure, en d\u00e9pit
          de sa s\u00e9paration en 1970, l''un des groupes de rock les plus populaires
          au monde. \nEn dix ans d''existence, et seulement huit ans de carri\u00e8re
          discographique (de 1962 \u00e0 1970), les Beatles ont enregistr\u00e9 douze
          albums originaux et ont compos\u00e9 plus de 200 chansons. Une productivit\u00e9
          particuli\u00e8rement remarquable dans la p\u00e9riode 1963\u20131966, o\u00f9,
          entre les tourn\u00e9es incessantes et la participation \u00e0 deux longs
          m\u00e9trages, ils ont publi\u00e9 sept albums, treize singles et douze EPs,
          par ailleurs emport\u00e9s dans un ph\u00e9nom\u00e8ne d''ampleur d\u00e9nomm\u00e9
          Beatlemania.\n\nConsid\u00e9r\u00e9es comme la \u00ab bande-son \u00bb des
          ann\u00e9es 1960, les chansons des Beatles ont marqu\u00e9 leur d\u00e9cennie
          ainsi que les g\u00e9n\u00e9rations suivantes, et leurs m\u00e9lodies ont
          \u00e9t\u00e9 adapt\u00e9es \u00e0 de nombreux genres musicaux, notamment
          le jazz, la salsa, le reggae, la soul ou la musique classique et baroque.
          \nAu XXIe si\u00e8cle, le groupe jouit toujours d''une grande popularit\u00e9
          ; ses chansons sont jou\u00e9es et reprises dans le monde entier. Le duo d''auteurs-compositeurs
          Lennon/McCartney reste c\u00e9l\u00e8bre comme cr\u00e9ateur de standards
          qui ont fait l''objet de milliers d''adaptations dans les d\u00e9cennies suivantes.\n\nLes
          Beatles demeurent les artistes ayant vendu le plus grand nombre de disques
          au monde. Ce chiffre \u00e9tait d\u00e9j\u00e0 estim\u00e9 par EMI dans les
          ann\u00e9es 1980 \u00e0 plus d''un milliard de CD, vinyles, et m\u00eame 78
          tours en Inde, vendus \u00e0 travers la plan\u00e8te et il a continu\u00e9
          \u00e0 augmenter jusqu''\u00e0 aujourd''hui atteignant un chiffre sup\u00e9rieur
          \u00e0 2 milliards. \nPar ailleurs, on a calcul\u00e9 dans les ann\u00e9es
          1970 qu''\u00e0 tout moment, l''une des interpr\u00e9tations de la chanson
          Yesterday (on en d\u00e9nombre plus de 3 000) \u00e9tait jou\u00e9e par une
          radio quelque part dans le monde.\n\n\u00ab Plac\u00e9s \u00e0 la proue \u00bb
          de l''\u00e9volution de la jeunesse et de la culture populaire des ann\u00e9es
          1960, leur style, leur habillement, leurs discours, leurs orientations, leur
          popularit\u00e9 plan\u00e9taire, leur conscience sociale et politique grandissantes
          au fil du temps, ont \u00e9tendu l''influence des Beatles bien au-del\u00e0
          de la musique, jusqu''aux r\u00e9volutions sociales et culturelles de leur
          \u00e9poque.","strBiographyCN":"\u62ab\u5934\u58eb\uff08\u82f1\u8bed\uff1aThe
