          \uff0c\u6765\u81ea\u4e8e\u82f1\u56fd\u5229\u7269\u6d66\u7684\u6447\u6eda\u4e50\u961f\uff081960\uff5e1970\uff09\uff0c\u6210\u54e1\u70ba\u7ea6\u7ff0\u00b7\u5217\u4fac\uff08\u4e3b\u97f3\u3001\u7bc0\u594f\u5409\u4ed6\u624b\u3001\u4f5c\u8a5e\u4f5c\u66f2\uff09\u3001\u4fdd\u7f85\u00b7\u9ea5\u5361\u5c3c\uff08\u4e3b\u97f3\u3001\u8d1d\u65af\u624b\u3001\u4f5c\u8a5e\u4f5c\u66f2\uff09\u3001\u55ac\u6cbb\u00b7\u54c8\u91cc\u68ee\uff08\u4e3b\u97f3\u5409\u4ed6\u624b\uff09\u53ca\u6797\u6208\u00b7\u65af\u5854\u5c14\uff08\u9f13\u624b\uff09\uff0c\u661f\u63a2\u53ca\u7ecf\u7eaa\u4eba\u70ba\u5e03\u840a\u6069\u00b7\u827e\u666e\u65af\u5766\u3002\n\u62ab\u5934\u58eb\u6a02\u968a\u88ab\u516c\u8a8d\u70ba\u82f1\u570b\u97f3\u6a02\u57281960\u5e74\u4ee3\u300c\u82f1\u570b\u5165\u4fb5\u300d\u7f8e\u570b\u7684\u4ee3\u8868\u4e50\u961f\u3002\u5176\u97f3\u6a02\u98a8\u683c\u6e90\u81ea1950\u5e74\u4ee3\u7684\u6416\u6efe\uff0c\u4e4b\u5f8c\u958b\u62d3\u4e86\u5404\u7a2e\u66f2\u98a8\u5982\u8ff7\u5e7b\u6416\u6efe\u3001\u6d41\u884c\u6416\u6efe\u3001\u53e4\u5178\u97f3\u6a02\u7684\u878d\u5408\u7b49\uff0c\u5176\u97f3\u6a02\u6027\u4e4b\u5275\u65b0\u6df1\u6df1\u5f71\u97ff\u4e86\u4e4b\u5f8c\u7684\u6b50\u7f8e\u6a02\u58c7\u767c\u5c55\uff0c\u5c24\u5176\u662f\u5217\u4fac\u4e0e\u9ea6\u5361\u7279\u5c3c\u8fd9\u4e00\u53cc\u5b50\u661f\u642d\u6863\u66f4\u662f\u97f3\u4e50\u4e50\u53f2\u4e0a\u6700\u4f73\u5531\u4f5c\u642d\u6863\u4e4b\u4e00\u3002\u800c\u4e14\u96a8\u8457\u4f5c\u54c1\u7684\u793e\u6703\u610f\u8b58\u65e5\u6f38\u52a0\u6df1\uff0c\u4ed6\u5011\u7684\u5f71\u97ff\u529b\u4e5f\u4f38\u5ef6\u5230\u516d\u5341\u5e74\u4ee3\u7684\u793e\u6703\u53ca\u6587\u5316\u9769\u547d\u65b9\u9762\u3002\n\u62ab\u5934\u58eb\u5e38\u88ab\u8a8d\u70ba\u662f\u6a02\u58c7\u6b77\u53f2\u4e0a\uff0c\u65e0\u8bba\u5546\u696d\u6027\u6216\u6587\u827a\u6027\u5747\u662f\u6700\u6210\u529f\u6700\u5049\u5927\u7684\u81f3\u5c0a\u6a02\u5718\uff0c\u4f9d\u7f8e\u56fd\u5531\u7247\u4e1a\u534f\u4f1a\u6b63\u5f0f\u7d71\u8a08\uff0c\u5176\u70ba\u7f8e\u570b\u570b\u5167\u751f\u