          \u0438 \u043f\u0438\u0448\u0443\u0442 \u043c\u0443\u0437\u044b\u043a\u0443.","strBiographyES":"The
          Beatles fue una banda de rock inglesa activa durante la d\u00e9cada de 1960,
          y reconocida como la m\u00e1s exitosa comercialmente y cr\u00edticamente aclamada
          en la historia de la m\u00fasica popular. Formada en Liverpool, estuvo constituida
          desde 1962 por John Lennon (guitarra r\u00edtmica, vocalista), Paul McCartney
          (bajo, vocalista), George Harrison (guitarra solista, vocalista) y Ringo Starr
          (bater\u00eda, vocalista). Enraizada en el skiffle y el rock and roll de los
          a\u00f1os cincuenta, la banda trabaj\u00f3 m\u00e1s tarde con distintos g\u00e9neros
          musicales, que iban desde las baladas pop hasta el rock psicod\u00e9lico,
          incorporando a menudo elementos cl\u00e1sicos, entre otros, de forma innovadora
          en sus canciones. La naturaleza de su enorme popularidad, que hab\u00eda emergido
          primeramente con la moda de la \u00abBeatleman\u00eda\u00bb, se transform\u00f3
          al tiempo que sus composiciones se volvieron m\u00e1s sofisticadas. Llegaron
          a ser percibidos como la encarnaci\u00f3n de los ideales progresistas, extendiendo
          su influencia en las revoluciones sociales y culturales de la d\u00e9cada
          de 1960.\n\nCon una formaci\u00f3n inicial de cinco componentes que inclu\u00eda
          a Lennon, McCartney, Harrison, Stuart Sutcliffe (bajo) y Pete Best (bater\u00eda),
          la banda construy\u00f3 su reputaci\u00f3n en los clubes de Liverpool y Hamburgo
          sobre un per\u00edodo de tres a\u00f1os a partir de 1960. Sutcliffe abandon\u00f3
          la formaci\u00f3n en 1961, y Best fue reemplazado por Starr al a\u00f1o siguiente.
          Establecidos como grupo profesional despu\u00e9s de que Brian Epstein les
          ofreciera ser su representante, y con su potencial musical mejorado por la
          creatividad del productor George Martin, lograron \u00e9xito comercial en
          el Reino Unido a finales de 1962 con su primer sencillo, \u00abLove Me Do\u00bb.
          A partir de ah\u00ed, fueron adquiriendo popularidad internacional a lo largo
          de los siguientes a\u00f1os, en los cuales hicieron un extenso n\u00famero
          de giras hasta 1966, a\u00f1o en que cesaron la actividad en vivo para dedicarse
          \u00fanicamente a la grabaci\u00f3n en el estudio hasta su disoluci\u00f3n
          en 1970. Despu\u00e9s, todos sus integrantes se embarcaron en exitosas carreras
          independientes. Lennon ser\u00eda asesinado a las afueras de su casa de Nueva
          York en 1980, y Harrison fallecer\u00eda de c\u00e1ncer en 2001. McCartney
          y Starr a\u00fan permanecen activos.\n\nDurante sus a\u00f1os de estudio crearon
          algunos de sus mejores materiales, incluyendo el \u00e1lbum Sgt. Pepper''s
          Lonely Hearts Club Band (1967), considerado por muchos como una obra maestra.
          Cuatro d\u00e9cadas despu\u00e9s de su separaci\u00f3n, la m\u00fasica que
          crearon contin\u00faa siendo popular. Se mantienen como el grupo con m\u00e1s
          n\u00fameros uno en las listas brit\u00e1nicas, situando m\u00e1s \u00e1lbumes
          en esta posici\u00f3n que cualquier otra agrupaci\u00f3n musical. De acuerdo
          con las certificaciones de la RIAA, han vendido m\u00e1s discos en los Estados
          Unidos que cualquier otro artista.5 En 2008, la revista Billboard public\u00f3
          una lista de los artistas m\u00e1s exitosos de todos los tiempos en el Hot
          100 con motivo del 50\u00ba aniversario de la lista de \u00e9xitos, y The
          Beatles fueron colocados en el n\u00famero uno. Fueron galardonados con siete
          premios Grammy, y recibieron un total de quince premios Ivor Novello de parte
          de la British Academy of Songwriters, Composers and Authors. En 2004, la revista
          Rolling Stone los clasific\u00f3 en el n\u00famero uno en su lista de los
          \u00ab100 artistas m\u00e1s grandes de todos los tiempos\u00bb.1 De acuerdo
          con la misma publicaci\u00f3n, la m\u00fasica innovadora de The Beatles y
          su impacto cultural ayudaron a definir los a\u00f1os sesenta. En 2010, el
          canal de televisi\u00f3n especializado en m\u00fasica VH1 los clasific\u00f3
          en el n\u00famero uno en su lista de los \u00ab100 artistas m\u00e1s grandes
          de todos los tiempos\u00bb. Tambi\u00e9n fueron colocados en el puesto No.
          1 por el sitio de Internet Acclaimed Music en su lista \u00abThe Top 1000
          Artists of All Time\u00bb y por Digital Dream Door en su lista \u00ab100 Greatest
          Rock Artists\u00bb.","strBiographyPT":"The Beatles foi uma banda de rock brit\u00e2nica,
          formada em Liverpool em 1960. \u00c9 o grupo musical mais bem-sucedido e aclamado
          da hist\u00f3ria da m\u00fasica popular. A partir de 1962, o grupo era formado
          por John Lennon (guitarra r\u00edtmica e vocal), Paul McCartney (baixo e vocal),
          George Harrison (guitarra solo e vocal) e Ringo Starr (bateria e vocal). Enraizada
          do skiffle e do rock and roll da d\u00e9cada de 1950, a banda veio mais tarde
          a assumir diversos g\u00eaneros que v\u00e3o do folk rock ao rock psicod\u00e9lico,
          muitas vezes incorporando elementos da m\u00fasica cl\u00e1ssica e outros,
          em formas inovadoras e criativas. Sua crescente popularidade, que a imprensa
          brit\u00e2nica chamava de \"Beatlemania\", fez com que eles crescessem em
          sofistica\u00e7\u00e3o. Os Beatles vieram a ser percebidos como a encarna\u00e7\u00e3o
          de ideais progressistas e sua influ\u00eancia se estendeu at\u00e9 as revolu\u00e7\u00f5es
          sociais e culturais da d\u00e9cada de 1960.\n\nCom a forma\u00e7\u00e3o inicial
          de Lennon, McCartney, Harrison, Stuart Sutcliffe (baixo) e Pete Best (bateria),
          os Beatles constru\u00edram sua reputa\u00e7\u00e3o nos pubs de Liverpool
          e Hamburgo durante um per\u00edodo de tr\u00eas anos a partir de 1960. Sutcliffe
          deixou o grupo em 61, e Best foi substitu\u00eddo por Starr no ano seguinte.
          Abastecida de equipamentos profissionais moldados por Brian Epstein, que depois
          se ofereceu para gerenciar a banda, e com seu potencial refor\u00e7ado pela
          criatividade do produtor George Martin, os Beatles alcan\u00e7aram um sucesso
          imediato no Reino Unido com seu primeiro single \"Love Me Do\". Ganhando popularidade
          internacional a partir do ano seguinte, excursionaram extensivamente at\u00e9
          1966, quando retiraram-se para trabalhar em est\u00fadio at\u00e9 sua dissolu\u00e7\u00e3o
          definitiva em 1970. Cada m\u00fasico ent\u00e3o seguiu para uma carreira independente.
          McCartney e Starr continuam ativos; Lennon foi baleado e morto em 1980, e
          Harrison morreu de c\u00e2ncer em 2001.\n\nDurante seus anos de est\u00fadio,
          os Beatles produziram o que a cr\u00edtica considera um dos seus melhores
          materiais, incluindo o \u00e1lbum Sgt. Pepper''s Lonely Hearts Club Band (1967),
          amplamente visto como uma obra-prima. Quatro d\u00e9cadas ap\u00f3s sua dissolu\u00e7\u00e3o,
          a m\u00fasica do grupo continua a ser muito popular. Os Beatles tiveram mais
          \u00e1lbuns em n\u00famero 1 nas paradas brit\u00e2nicas do que qualquer outro
          grupo musical. De acordo com a RIAA, eles venderam mais \u00e1lbuns nos Estados
          Unidos do que qualquer outro artista. Em 2008, a Billboard divulgou uma lista
          dos top-selling de todos os tempos dos artistas Hot 100 para celebrar o cinquenten\u00e1rio
          das paradas de singles dos Estados Unidos, e a banda permaneceu em primeiro
          lugar. Eles j\u00e1 foram honrados com 8 Grammy Awards, e 15 Ivor Novello
          Awards da BASCA. . J\u00e1 venderam mais de um bilh\u00e3o de discos. Os Beatles
          foram coletivamente inclu\u00eddos na compila\u00e7\u00e3o da revista Time
          das 100 pessoas mais importantes e influentes do s\u00e9culo XX.","strBiographySE":"The
          Beatles var en stilbildande brittisk rockgrupp sprungen ur 1960-talet. Gruppen
          bestod av fyra medlemmar: John Lennon (1940-1980), Paul McCartney (f\u00f6dd
          1942), George Harrison (1943-2001) och Ringo Starr (f\u00f6dd 1940). Samtliga
          fr\u00e5n Liverpool i Storbritannien. The Beatles \u00e4r fortfarande en av
          v\u00e4rldens popul\u00e4raste rockgrupper och deras skivor/l\u00e5tar brukar
          toppa omr\u00f6stningar n\u00e4r kritiker och lyssnare r\u00f6star om v\u00e4rldens
          b\u00e4sta skiva/l\u00e5t.\n\n1957 ledde John Lennon gruppen The Quarrymen.
          Han tr\u00e4ffade Paul McCartney den 6 juli 1957 p\u00e5 ett torg i St Peter\u00b4s
          Church i Wolton, Liverpool d\u00e4r d\u00e5 John upptr\u00e4dde. John Lennon
          blev imponerad \u00f6ver Pauls kunskaper om ackord och hur gitarrer skulle
          st\u00e4mmas, s\u00e5 John l\u00e4t honom vara med. Paul, som hade kontakt
          med George Harrison, ville ha med \u00e4ven honom (det s\u00e4gs att John
          l\u00e4t George vara med f\u00f6r att han hade ett st\u00e4lle att repa p\u00e5).
          I b\u00f6rjan var de mycket inspirerade av samtida amerikanska musiker som
          Chuck Berry, Elvis Presley, Buddy Holly med flera och gruppen var f\u00f6rst
          ett rent coverband. Ganska snart b\u00f6rjade Lennon och McCartney att skriva
          egna l\u00e5tar. Gruppens namn \u00e4ndrades flitigt under de f\u00f6rsta
          \u00e5ren, bland annat hette de Johnny and The Moondogs och Long John and
          the Silver Beatles. Men fr\u00e5n och med 1960 var det det dubbeltydiga namnet
          The Beatles som g\u00e4llde. Namnet kommer av orden beat, som betyder takt,
          och beetle, (skalbagge). Ett ord som ocks\u00e5 associerade till den frisyr
          med l\u00e5ng lugg som gruppen skaffade sig. Den som anses vara uppfinnaren
          av namnet The Beatles \u00e4r gruppens d\u00e5varande basist Stu Sutcliffe.","strBiographyNL":"The
          Beatles is een voormalige popgroep uit de Engelse stad Liverpool. De bezetting
          bestond uit John Lennon, Paul McCartney, George Harrison en Ringo Starr. De
          groep was actief van 1960 tot 1970 en wordt nu nog steeds beschouwd als de
          meest invloedrijke band uit de geschiedenis van de popmuziek. Al vrij snel
          na hun doorbraak kregen de leden van The Beatles te maken met hysterische
          reacties van voornamelijk jonge tienermeisjes, die tijdens concerten de muziek
          met hun gegil overstemden. Voor dit gedrag raakte de term \"Beatlemania\"
          in zwang. Tijdens hun carri\u00e8re verrichtten ze pionierswerk in de geluidsstudio,
          waarvoor ze in brede kring lof oogstten. Onder hun invloed groeide de popmuziek
          uit van een op Amerikaanse rhythm and blues gebaseerd genre tot een veel breder
          geori\u00ebnteerde muzieksoort.\n\nThe Beatles-leden John Lennon en Paul McCartney
          waren de belangrijkste liedjesschrijvers van het viertal. Tot de bekendste
          hits van The Beatles behoren: I Want to Hold Your Hand, She Loves You, Yesterday,
          Michelle, Yellow Submarine, Lucy in the Sky with Diamonds, All You Need Is
          Love, Hey Jude, Let It Be, Help!, Penny Lane, Come Together en Strawberry
          Fields Forever.\n\nHun album Sgt. Pepper''s Lonely Hearts Club Band uit 1967
          geldt als een mijlpaal in de popgeschiedenis.","strBiographyHU":"A The Beatles
          angol rockzenekar volt a rockzene egyik legnagyobb hat\u00e1s\u00fa \u00e9s
          legsikeresebb zenekara, amely 2004 v\u00e9g\u00e9ig vil\u00e1gszerte t\u00f6bb
          mint 1,3 milli\u00e1rd lemezt adott el, t\u00f6bbet mint b\u00e1rmely m\u00e1s
          egy\u00fcttes. A m\u0171v\u00e9szetek b\u00e1rmely \u00e1g\u00e1t is n\u00e9zve,
          kevesen voltak, akik n\u00e9pszer\u0171s\u00e9g\u00fckh\u00f6z, kritikai elismerts\u00e9g\u00fckh\u00f6z
          \u00e9s sz\u00e9les k\u00f6r\u0171 kultur\u00e1lis hat\u00e1sukhoz m\u00e9rhet\u0151ek.\nA
          Beatles t\u00f6bb elad\u00e1si rekordot is fel\u00e1ll\u00edtott \u00e9s t\u00f6bb
          mint \u00f6tven Top 40-es kislemez\u00fck jelent meg. Az els\u0151 brit zenekar
          volt, mely folyamatos n\u00e9pszer\u0171s\u00e9gre tett szert az USA-ban,
          nem kevesebb, mint 27 no.1. helyezett dalt jegyezve csak Nagy-Britanni\u00e1ban
          \u00e9s az USA-ban; ennek k\u00f6sz\u00f6nhet\u0151en a Beatles a 20. sz\u00e1zad
          legsikeresebb zenekara lett. Az EMI 1985-\u00f6s becsl\u00e9sei szerint addigra
          m\u00e1r t\u00f6bb mint egymilli\u00e1rd lemezt adtak el vil\u00e1gszerte.
          \u201eYesterday\u201d c\u00edm\u0171 daluk a modern kori zenet\u00f6rt\u00e9net
          legt\u00f6bbsz\u00f6r feldolgozott dala (t\u00f6bb mint 3000 v\u00e1ltozata
          l\u00e9tezik).","strBiographyNO":"The Beatles var et engelsk rockeband fra
          Liverpool som ble dannet i 1959/1960. Bandet besto av James Paul McCartney,
          John Winston Lennon, George Harrison og Ringo Starr (Richard Starkey). De
          debuterte p\u00e5 plate i 1962 med singelen \u00abLove Me Do\u00bb som hadde
          moderat suksess. Det store gjennombruddet i Storbritannia kom i 1963 med gruppens
          andre singel, \u00abPlease Please Me\u00bb, som gikk til topps p\u00e5 de
          engelske hitlistene. Gjennombruddet i De forente stater kom i februar 1964,
          med singelen \u00abI Want to Hold Your Hand\u00bb.\n\nGruppen forble en av
          de fremste popul\u00e6rmusikkgruppene gjennom hele 1960-tallet, frem til den
          ble offisielt oppl\u00f8st i 1970. De hadde da dominert hitlistene og musikkbransjen
          p\u00e5 begge sider av Atlanteren gjennom hele karrieren.\n\nDe p\u00e5virket
          etterkrigstidens babyboom-generasjon i Storbritannia, De forente stater og
          mange andre land i 1960-\u00e5rene. De er utvilsomt den mest popul\u00e6re
          gruppen i rockehistorien, med over 1 milliard solgte plater verden over.\n\nSelv
          om de helt i begynnelsen var kjent for en variant av lett popmusikk som ble
          kalt merseybeat, ble deres senere verker mottatt med en popularitet og kritisk
          hyllest som kanskje overg\u00e5r alt i det 20. \u00e5rhundre. De ble mer enn
          kun plateartister, og p\u00e5virket moter og kultur, med ringvirkninger til
          film og politisk aktivisme. De oppn\u00e5dde en ikonstatus som ga dem enorm
          p\u00e5virkningskraft.\n\nI 1988 ble The Beatles innvotert i Rockens \u00e6resgalleri.
          Senere har Lennon, McCartney og Harrison oppn\u00e5dd det samme som soloartister.","strBiographyIL":"\u05d4\u05d1\u05d9\u05d8\u05dc\u05e1
