          '{"track":[{"idTrack":"32724822","idAlbum":"2109681","idArtist":"111247","idLyric":"0","idIMVDB":"0","strTrack":"Help!","strAlbum":"Help!","strArtist":"The
          Beatles","strArtistAlternate":null,"intCD":null,"intDuration":"139560","strGenre":"Rock
          & Roll","strMood":"Happy","strStyle":"Rock/Pop","strTheme":"...","strDescriptionEN":"\"Help!\"
          is a song by the Beatles that served as the title song for both the 1965 film
          and its soundtrack album. It was also released as a single, and was number
          one for three weeks in both the United States and the United Kingdom.\n\n\"Help!\"
          was written by John Lennon and credited to Lennon\u2013McCartney. During an
          interview with Playboy in 1980, Lennon recounted: \"The whole Beatles thing
          was just beyond comprehension. I was subconsciously crying out for help\".\n\nIt
          was ranked no. 29 on Rolling Stone''s 500 Greatest Songs of All Time.\n\nThe
          documentary series The Beatles Anthology revealed that Lennon wrote the lyrics
          of the song to express his stress after the Beatles'' quick rise to success.
          \"I was fat and depressed and I was crying out for ''Help'',\" Lennon told
          Playboy. Writer Ian MacDonald describes the song as the first crack in the
          protective shell Lennon had built around his emotions during the Beatles''
          rise to fame, and an important milestone in his songwriting style.\n\nIn the
          1970 Rolling Stone \"Lennon Remembers\" interviews, Lennon said it was one
          of his favourites among the Beatles songs he wrote, but he wished they had
          recorded it at a slower tempo. In these interviews, Lennon said he felt that
          \"Help!\" and \"Strawberry Fields Forever\" were his most honest, genuine
          Beatles songs and not just songs \"written to order\". According to Lennon''s
          cousin and boyhood friend Stanley Parkes, however, \"Help!\" was written after
          Lennon \"came in from the studio one night. ''God,'' he said, ''they''ve changed
          the title of the film: it''s going to be called ''Help!'' now. So I''ve had
          to write a new song with the title called ''Help!''.\"\n\nAccording to McCartney,
          he was called in \"to complete it\", providing the \"countermelody\" arrangement,
          on 4 April 1965 at Lennon''s house in Weybridge.\n\nThe Beatles recorded \"Help!\"
          in 12 takes on 13 April 1965 using four-track equipment. The first nine takes
          concentrated on the instrumental backing. The descending lead guitar riff
          that precedes each verse proved to be difficult, so by take 4 it was decided
          to postpone it for an overdub. To guide the later overdub by Harrison, Lennon
          thumped the beat on his acoustic guitar body, which can be heard in the final
          stereo mix. Lead and backing vocals were recorded twice onto take 9, along
          with a tambourine. A reduction mix was applied to the two vocal tracks, taking
          three attempts (takes 10 to 12), freeing up a track for the lead guitar overdub.
          This was the group''s first use of two 4-track machines for \"bouncing\".\n\nThe
          vocals were re-recorded for the film during a session on 24 May 1965 at CTS
          Studios, a facility specializing in post-synchronisation. In addition to attempting
          a better vocal performance, the session might have been done to eliminate
          the tambourine (which had been on the same track as the vocals) since no tambourine
          appeared in the film sequence. With the new vocals, a mono mix was created
          at CTS Studios which was used for the film soundtrack. Mixes for record releases
          were prepared on 18 June. For the mono version, Martin decided to use a mix
          of the opening chorus of take 12 edited to the remainder of the CTS film mix.
          Because all instruments were combined on a single track for the CTS session,
          it could not be used for a stereo mix, so the stereo mix was made from take
          12.\n\nNew mixes were created for releases of the Help! CD (1987), the Love
          album (2006), and the Help! DVD (2007).","strDescriptionDE":null,"strDescriptionFR":null,"strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":null,"strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"strTrackThumb":null,"strTrack3DCase":null,"strTrackLyrics":"","strMusicVid":"","strMusicVidDirector":"Richard
