          & Roll","strMood":"Happy","strStyle":"Rock/Pop","strTheme":"...","strDescriptionEN":"\"Come
          Together\" is a song by the Beatles written primarily by John Lennon and credited
          to Lennon\u2013McCartney. The song is the opening track on the album Abbey
          Road and was also released as a single coupled with \"Something\". The song
          reached the top of the charts in the United States and peaked at No. 4 in
          the United Kingdom.\n\n\"Come Together\" started as Lennon''s attempt to write
          a song for Timothy Leary''s campaign for governor of California against Ronald
          Reagan, which promptly ended when Leary was sent to prison for possession
          of marijuana:\n\nThe thing was created in the studio. It''s gobbledygook;
          Come Together was an expression that Leary had come up with for his attempt
          at being president or whatever he wanted to be, and he asked me to write a
          campaign song. I tried and tried, but I couldn''t come up with one. But I
          came up with this, Come Together, which would''ve been no good to him - you
          couldn''t have a campaign song like that, right?\n\nIt has been speculated
          that each verse refers cryptically to one of the Beatles. It has also been
          suggested that the song has only a single \"pariah-like protagonist\" and
          Lennon was \"painting another sardonic self-portrait\".\n\nLennon played rhythm
          guitar and sang the vocal, McCartney played bass, Harrison played lead guitar,
          and Starr played drums. It was produced by George Martin and recorded at the
          end of July 1969 at Abbey Road Studios. In the intro, Lennon says: \"shoot
          me\", which is accompanied by his handclaps and McCartney''s heavy bass riff.
          The famous Beatles'' \"walrus\" from \"I Am the Walrus\" and \"Glass Onion\"
          returns in the line \"he got walrus gumboot\", followed by \"he got Ono sideboard\".
          Bluesman Muddy Waters is also mentioned in the song.\n\nMusic critic Ian MacDonald
          reports that McCartney sang a backing vocal, but recording engineer Geoff
          Emerick said that Lennon did all the vocals himself, and when a frustrated
          McCartney asked Lennon, \"What do you want me to do on this track, John?\",
          Lennon replied, \"Don''t worry, I''ll do the overdubs on this.\"\n\nIn a 1970
          interview in the Evening Standard, McCartney said he was disappointed about
          not singing live with Lennon; instead, he overdubbed his vocals later:\n\nEven
          on Abbey Road we don''t do harmonies like we used to. I think it''s sad. On
          \"Come Together\" I would have liked to sing harmony with John, and I think
          he would have liked me to, but I was too embarrassed to ask him, and I don''t
          work to the best of my abilities in that situation.\n\n\"Come Together\" is
          a blues rock song, which consists of a repeating verse/refrain structure,
          broken up by a guitar solo acting as a bridge. For the first eight bars, the
          tonic note D is repeated, eventually moving to the V chord and then to the
          IV chord. It then moves to the VI minor chord. The refrain in actuality is
          three bars long, because the melody keeps going after the last A5 chord and
          comes to rest on the D5 chord after that. F# is introduced in the melody with
          a B minor triad. The tonic is held for four bars between each verse and is
          the same as the contents of the introduction.\n\nWithin the verse there are
          four one-bar structures; each one a non-sequitur. The lyrics end each time
          on the abrupt beat four of each measure, giving the verse an AAAA phrasing
          structure. The phrasing structure in the second half of the verse is two bars
          of BB. The C phrasing structure of the refrain has three measures becoming
          one long phrase and ending on the word \"me\" which ties everything together.
          There is an eleven-bar verse/refrain from a ten bar form. The melody of the
          verse stays within the range of a perfect fourth. Using mostly three notes
          (D, F, C) the tonic, flat three and flat seven, it moves away later only for
          contrast when it hits the II (E) and stays on that note for two bars. The
          refrain stands out as the highest notes in the piece (A).","strDescriptionDE":null,"strDescriptionFR":null,"strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":null,"strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"strTrackThumb":null,"strTrack3DCase":null,"strTrackLyrics":"","strMusicVid":"","strMusicVidDirector":"Alexandre
