          & Roll","strMood":"Happy","strStyle":"Rock/Pop","strTheme":"...","strDescriptionEN":"\"Something\"
          is a song by the English rock band the Beatles from their 1969 album Abbey
          Road. It was written by George Harrison, the band''s lead guitarist. Soon
          after the album''s release, the song was issued as a single, coupled with
          \"Come Together\", making it the first Harrison composition to become a Beatles
          A-side. Its pairing with \"Come Together\" was also the first time in the
          United Kingdom that the Beatles issued a single containing tracks that were
          already available on an album. The single topped the Billboard Hot 100 in
          the United States as well as charts in Australia, Canada, New Zealand and
          West Germany, and peaked at number 4 in the UK.\n\n\"Something\" is widely
          viewed by music historians as having marked Harrison''s ascendancy as a composer
          to the level of the Beatles'' principal songwriters, John Lennon and Paul
          McCartney. It is described as a love song to Pattie Boyd, Harrison''s first
          wife, although Harrison offered alternative sources of inspiration in later
          interviews. Due to the difficulty he faced in getting more than two of his
          compositions onto each Beatles album, Harrison first offered \"Something\"
          to Joe Cocker. As recorded by the Beatles, the track features a guitar solo
          that several music critics identify among Harrison''s finest playing. The
          song also drew praise from the other Beatles and their producer, George Martin,
          with Lennon stating that it was the best song on Abbey Road. The promotional
          film for the single combined footage of each of the Beatles with their respective
          wife, reflecting the estrangement in the band during the months preceding
          the official announcement of their break-up in April 1970.\n\n\"Something\"
          received the Ivor Novello Award for the \"Best Song Musically and Lyrically\"
          of 1969. Harrison subsequently performed the song at his Concert for Bangladesh
          shows in 1971 and throughout the two tours he made as a solo artist. Up to
          the late 1970s, it had been covered by over 150 artists, making it the second-most
          covered Beatles composition after \"Yesterday\". Shirley Bassey had a top-five
          UK hit with her 1970 recording, while Frank Sinatra regularly performed the
          song. Other artists who have covered \"Something\" include Elvis Presley,
          Ray Charles, Peggy Lee, James Brown, Tony Bennett, Andy Williams, Smokey Robinson
          and Ike & Tina Turner. In 1999, Broadcast Music Incorporated named \"Something\"
          as the 17th-most performed song of the twentieth century, with 5 million performances.
          In 2004, it was ranked at number 278 on Rolling Stone''s list of \"The 500
          Greatest Songs of All Time\", while two years later, Mojo placed it at number
          7 in the magazine''s list of the Beatles'' best songs. A year after Harrison''s
          death in November 2001, McCartney and Eric Clapton performed it at the Concert
          for George tribute at London''s Royal Albert Hall.","strDescriptionDE":null,"strDescriptionFR":null,"strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":null,"strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"strTrackThumb":null,"strTrack3DCase":null,"strTrackLyrics":"","strMusicVid":"https://www.youtube.com/watch?v=UelDrZ1aFeY","strMusicVidDirector":"The
