          & Roll","strMood":"Happy","strStyle":"Rock/Pop","strTheme":"...","strDescriptionEN":"\"Let
          It Be\" is a song by the English rock band the Beatles, released in March
          1970 as a single, and (in an alternate mix) as the title track of their album
          Let It Be. At the time, it had the highest debut on the Billboard Hot 100,
          reaching number 6. It was written and sung by Paul McCartney. It was their
          final single before McCartney announced his departure from the band. Both
          the Let It Be album and the US single \"The Long and Winding Road\" were released
          after McCartney''s announced departure from and the subsequent break-up of
          the group.\n\nThe alternate mix on their album \"Let It Be\" features an additional
          guitar solo and some minor differences in the orchestral sections.\n\nIn 1987,
          the song was recorded by charity supergroup Ferry Aid (which included McCartney).
          It reached number 1 on the UK Singles Chart for three weeks and reached the
          top ten in many other European countries.\n\nMcCartney said he had the idea
          of \"Let It Be\" after he had a dream about his mother during the tense period
          surrounding the sessions for The Beatles (\"the White Album\") in 1968. According
          to McCartney, the song''s reference to \"Mother Mary\" was not a biblical
          reference. The phrase has at times been used as a reference to the Virgin
          Mary, the mother of Jesus Christ; in fact, the words \"let it be\" are a direct
          quote from the Prayer of the Annunciation, Mary''s response to the Angel Gabriel
          in Luke 1.38. Nevertheless, McCartney explained that his mother \u2013 who
          died of cancer when he was fourteen \u2013 was the inspiration for the \"Mother
          Mary\" lyric. He later said: \"It was great to visit with her again. I felt
          very blessed to have that dream. So that got me writing ''Let It Be''.\" He
          also said in a later interview about the dream that his mother had told him,
          \"It will be all right, just let it be.\" When asked if the song referred
          to the Virgin Mary, McCartney has typically answered the question by assuring
          his fans that they can interpret the song however they would like.\n\nThe
          first rehearsal of \"Let It Be\" took place at Twickenham Film Studios on
          3 January 1969, where the group had, the previous day, begun what would become
          the Let It Be film. During this stage of the film they were only recording
          on the mono decks used for syncing to the film cameras, and were not making
          multi-track recordings for release. A single take was recorded, with just
          McCartney on piano and vocals. The first attempt with the other Beatles was
          made on 8 January. Work continued on the song throughout the month. Multi-track
          recordings commenced on 23 January at Apple Studios.\n\nThe master take was
          recorded on 31 January 1969, as part of the \"Apple studio performance\" for
          the project. McCartney played Bl\u00fcthner piano, Lennon played six-string
          electric bass, George Harrison and Ringo Starr assumed their conventional
          roles, on guitar and drums respectively, and Billy Preston contributed on
          organ. This was one of two performances of \"Let It Be\" that day. The first
          version, designated take 27-A, would serve as the basis for all officially
          released versions of the song. The other version, take 27-B, was performed
          as part of the \"live studio performance\", along with \"Two of Us\" and \"The
          Long and Winding Road\". This performance, in which Lennon and Harrison harmonised
          with McCartney''s lead vocal and Harrison contributed a subdued guitar solo,
          can be seen in the film Let It Be.\n\nThe film performance of \"Let It Be\"
          has never been officially released as an audio recording. The lyrics in the
          two versions differ a little in the last verse. The studio version has mother
          Mary comes to me \u2026 there will be an answer, whereas the film version
          has mother Mary comes to me \u2026 there will be no sorrow. In addition, McCartney''s
          vocal performance is noticeably different in both versions: in the film version,
          it sounds a rough in certain moments since he is not using anti-pop on his
          mic; there are also a couple of falsetto vocals performed by him (extending
          the vocal ''e'' on the word ''be''), for instance in the ''let it be'' line
          that precedes the second chorus. Finally, the instrumental progression featured
          on the middle of the song after the second chorus (that descends from F to
          C), which is played twice on all released studio versions, is played (or at
          least is shown being played) only once in the film.\n\nOn 30 April 1969, Harrison
          overdubbed a new guitar solo on the best take from 31 January. He overdubbed
          another solo on 4 January 1970. The first overdub solo was used for the original
          single release, and the second overdub solo was used for the original album
          release. Some fans mistakenly believe that there were two versions of the
          basic track \u2013 based mostly on the different guitar solos, but also on
          other differences in overdubs and mixes.","strDescriptionDE":null,"strDescriptionFR":null,"strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":null,"strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"strTrackThumb":null,"strTrack3DCase":null,"strTrackLyrics":"","strMusicVid":"","strMusicVidDirector":"","strMusicVidCompany":"","strMusicVidScreen1":null,"strMusicVidScreen2":null,"strMusicVidScreen3":null,"intMusicVidViews":"0","intMusicVidLikes":"0","intMusicVidDislikes":"0","intMusicVidFavorites":"0","intMusicVidComments":"0","intTrackNumber":"14","intLoved":"2","intScore":"9.55556","intScoreVotes":"9","intTotalListeners":"981810","intTotalPlays":"7131428","strMusicBrainzID":"c3ab18e7-e17a-4064-a352-834b67513f33","strMusicBrainzAlbumID":"73c61a5d-9623-3d00-afbf-b3c6dc5e8b92","strMusicBrainzArtistID":"b10bbbfc-cf9e-42e0-be17-e2c3e1d2600d","strLocked":"Unlocked"},{"idTrack":"32821787","idAlbum":"2118151","idArtist":"111247","idLyric":"0","idIMVDB":null,"strTrack":"You
