          Jude","strAlbum":"1","strArtist":"The Beatles","strArtistAlternate":null,"intCD":null,"intDuration":"424440","strGenre":"Rock
          & Roll","strMood":"Happy","strStyle":"Rock/Pop","strTheme":"...","strDescriptionEN":"\"Hey
          Jude\" is a song by the English rock band the Beatles that was released as
          a non-album single in August 1968. It was written by Paul McCartney and credited
          to the Lennon\u2013McCartney partnership. The single was the Beatles'' first
          release on their Apple record label and one of the \"First Four\" singles
          by Apple''s roster of artists, marking the label''s public launch. \"Hey Jude\"
          was a number-one hit in many countries around the world and became the top-selling
          single of 1968 in the UK, the US, Australia and Canada. Its nine-week run
          at number one on the Billboard Hot 100 tied the all-time record in 1968 for
          the longest run at the top of the US charts. It has sold approximately eight
          million copies and is frequently included on music critics'' lists of the
          greatest songs of all time.\n\nThe writing and recording of \"Hey Jude\" coincided
          with a period of upheaval in the Beatles. The ballad evolved from \"Hey Jules\",
          a song McCartney wrote to comfort John Lennon''s son, Julian, after Lennon
          had left his wife for the Japanese artist Yoko Ono. The lyrics espouse a positive
          outlook on a sad situation, while also encouraging \"Jude\" to pursue his
          opportunities to find love. After the fourth verse, the song shifts to a fade-out
          coda. Lasting for over four minutes, it is longer than the rest of the song.
          Recording for the song took place midway through the sessions for the Beatles''
          self-titled double album (also known as the \"White Album\") and led to an
          argument between McCartney and George Harrison over Harrison''s idea for the
          guitar part. Ringo Starr later left the band only to return shortly before
          they filmed the promotional clip for the single. The clip was directed by
          Michael Lindsay-Hogg and first aired on David Frost''s UK television show.
          Contrasting with the problems afflicting the band, this performance captured
          the song''s theme of optimism and togetherness by featuring the studio audience
          joining the Beatles as they sang the coda.\n\n\"Hey Jude\" was the first Beatles
          song to be recorded on eight-track recording equipment, with the sessions
          taking place at Trident Studios in central London. The song''s arrangement
          and extended coda encouraged many imitative works through to the early 1970s.
          At more than seven minutes in length, it was the longest single ever to top
          the British charts. In 2013, Billboard magazine named it the 10th \"biggest\"
          song of all time in terms of chart success. McCartney has continued to perform
          \"Hey Jude\" in concert since Lennon''s death in 1980, leading audiences in
          singing the coda. Julian Lennon and McCartney have each bid successfully at
          auction for items of memorabilia related to the song''s creation.","strDescriptionDE":null,"strDescriptionFR":null,"strDescriptionCN":null,"strDescriptionIT":null,"strDescriptionJP":null,"strDescriptionRU":null,"strDescriptionES":null,"strDescriptionPT":null,"strDescriptionSE":null,"strDescriptionNL":null,"strDescriptionHU":null,"strDescriptionNO":null,"strDescriptionIL":null,"strDescriptionPL":null,"strTrackThumb":null,"strTrack3DCase":null,"strTrackLyrics":"","strMusicVid":"https://www.youtube.com/watch?v=A_MjCqQoLLA","strMusicVidDirector":"Michael
